var book = {
	"name": "Levitico",
	"numChapters": 27,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> Ket ni Jehova inayabanna ni Moises ket nakisao kencuana nanipud iti tolda ti gimong, a kinunana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel, ket cunaem cadacuada, No adda maysa cadacayo a mangipaay iti daton ken Jehova, aramatenyonto a pagdaton dagiti an-animal, a dagiti met laeng vacvaca ken carcarnero.",
			"3": "<sup>3</sup> No vaca ti mapuuran a pagdatonna, idatonnanto ti lalaki nga awan pacapilawanna: ti pangidatonannanto iti ruangan ti tolda ti gimong, tapno maawat iti saclang ni Jehova.",
			"4": "<sup>4</sup> Ket ipataynanto ti imana iti rabaw ti olo ti idatonna a mapuuran; ket maipategto kencuana a maibilang a pacaabbonganna.",
			"5": "<sup>5</sup> Ket mangpatayto iti vaca a lalaki iti sango ni Jehova: ket dagiti annac a lallaki ni Aaron, dagiti papadi, idatagdanto ti dara, ket iwarisdanto ti dara iti lawlaw ti rabaw ti altar nga adda iti ruangan ti tolda ti gimong.",
			"6": "<sup>6</sup> Ket lalatennanto ti daton a mapuuran, ket rangrangcayennanto.",
			"7": "<sup>7</sup> Ket dagiti annac ni Aaron a padi mangicabildanto ti apuy iti rabaw ti altar, yet urnosenda ti sungrod a maiparabaw iti apuy;",
			"8": "<sup>8</sup> Ket dagiti annac ni Aaron, dagiti papadi, icabildanto a pagoornosen dagiti rinangcay, ti olo, ken ti taba, iti rabaw ti cayo a ngatoen ti apuy iti rabaw ti altar:",
			"9": "<sup>9</sup> Ngem dagiti lalaemna ken sacsacana buggoannanto iti danum: ket ti padi puurannanto ida amin nga daton a mapuuran, iti rabaw ti altar, maysa a daton a naaramid iti apuy, a nabanglo a sayamusom ken Jehova.",
			"10": "<sup>10</sup> Ket no ti idatonna aggapu iti pangen, cadagiti carcarnero, wenno cadagiti calcalding, a daton a mapuuran; iti lalaki nga awan pilawna ti idatonnanto.",
			"11": "<sup>11</sup> Ket patayennanto iti sibay ti altar iti amianan iti saclang ni Jehova; ket dagiti annac ni Aaron, dagiti papadi, iwarisdanto ti darana iti rabaw ti altar nga aglawlaw.",
			"12": "<sup>12</sup> Ket isu rangcayennanto agraman olona ken tabana; ket ti padi icabilnanto ida ti naurnos iti rabaw ti cayo nga adda iti ngatoen ti apuy iti altar:",
			"13": "<sup>13</sup> Ngem dagiti lalaem ken dagiti sacsaca buggoannanto iti danum; ket ti padi idatonnanto amin, ket puurannanto iti altar: isu ti maysa a daton a mapuuran, maysa a daton a naaramid iti apuy, a nabanglo a sayamusom ken Jehova.",
			"14": "<sup>14</sup> Ket no ti idatagna ken Jehova maysa a daton a mapuuran cadagiti tumatayab, idatagnanto nga idaton ngarud dagiti pagpagaw wenno urbon dagiti calapati.",
			"15": "<sup>15</sup> Ket ti padi ipannanto iti altar, ket pulsutennanto ti olona, ket puurannanto iti rabaw ti altar; ket ti darana ipatedtednanto iti sibay ti altar;",
			"16": "<sup>16</sup> Ket iccatennato ti kinaracaranna agraman rugitna ket ibellengna iti sikigan ti altar iti daya a pagdissoan dagiti dapo:",
			"17": "<sup>17</sup> Ket iggamannanto dagiti payacna tapno pisangenna, ngem dinanto gerreten; ket ti padi puurannanto iti rabaw dagiti sungrod ti apuy: isu ti maysa a daton a mapuuran, maysa a daton a naaramid iti apuy, a nabanglo a sayamusom ken Jehova."
		},
		"2": {
			"1": "<sup>1</sup> Ket no adda mangipaay iti daton a bel-laay ken Jehova, ti namayecmec nga harina idatonnanto; ket buyatannanto iti lana, sana icabilto ti incienso;",
			"2": "<sup>2</sup> Ket ipannanto cadagiti papadi nga annac a lallaki ni Aaron; ket isu irakemnanto ti imana iti dadduma nga harinana a namayecmec, ken iti dadduma a lanana, agraman amin a inciensona; ket ti padi puurannanto iti altar a cas panglagip kencuana, maysa a daton a maaramid iti apuy, a nabanglo a sayamusom ken Jehova:",
			"3": "<sup>3</sup> Ket ti matda iti daton a bel-laay maipatagicuanto ken Aaron ken dagiti annacna a lallaki: isu ti maysa nga aramid a nasantoan unay dagiti datdaton a maaramid iti apuy ken Jehova.",
			"4": "<sup>4</sup> Ket no mangidatagca iti daton a bel-laay a naluto iti horno, isunto dagiti torta nga harina a namayecmec nga awan levadurana, a nagamayan iti lana, wenno dagiti bibingca a di-nalevaduraan a sinapsapoan iti lana.",
			"5": "<sup>5</sup> Ket no ti idatagmo maysa a daton a bel-laay a naluto iti bandeja ti horno, dagitinto namayecmec nga harina a di-nalevaduraan a nagamayan iti lana.",
			"6": "<sup>6</sup> Pispisiemto ket lanaamto: isu ti maysa a daton a bel-laay.",
			"7": "<sup>7</sup> Ket no ti idatagmo maysa a daton a bel-laay a naluto iti parioc, ti namayecmec nga harina nga adda lanana ti maaramidto.",
			"8": "<sup>8</sup> Ket ipanmonto ti daton a bel-laay a naaramid cadagitoy a ramitramit ken Jehova: ket isunto ti maiparang iti padi, ket isu ipannanto iti altar.",
			"9": "<sup>9</sup> Ket ti padi mangalanto iti daton a bel-laay ti panglaglagip kencuana, ket puurannanto iti rabaw ti altar, maysa a daton a maaramid iti apuy, a nabanglo a sayamusom ken Jehova.",
			"10": "<sup>10</sup> Ket ti matda iti daton a bel-laay cucuanto ni Aaron ken dagiti annacna a lallaki: isu ti maysa nga aramid a nasantoan unay cadagiti datdaton a maaramid iti apuy ken Jehova.",
			"11": "<sup>11</sup> Saanto a nalevaduraan ti daton a bel-laay nga idatonyonto ken Jehova; ta dicayto puuran ti levadura wenno diro a daton a naaramid iti apuy ken Jehova.",
			"12": "<sup>12</sup> Idatagyonto ida a pagdaton dagiti umuna a bungbunga ken Jehova: ngem saandanto a maipan nga agservi a nabanglo a sayamusom iti rabaw ti altar.",
			"13": "<sup>13</sup> Ket tumunggal maidatag ti datonmo a bel-laay asinamto; ket dicanto liwayan ti asin ti tulag ti Diosmo iti datonmo a bel-laay: dagup amin a datonmo pakidatonmonto ti asin.",
			"14": "<sup>14</sup> Ket no idatagmo ti maysa a daton a canen dagiti umuna a bungbunga ken Jehova, ipaaymonto a daton a canen dagiti umuna a bunbunga ti trigo a sibubukel ti dawana a nairuban, napilpil a binukel ti nalangto a dawa.",
			"15": "<sup>15</sup> Ket iccamto iti lana, saca parabawanto ti incienso: isu ti maysa a daton a canen.",
			"16": "<sup>16</sup> Ket ti padi puurannanto ti panglagip itoy, nga isu ti dadduma ti napilpil a bukel, ken ti dadduma ti lanana, agraman amin ti inciensona: isu ti maysa a daton a maaramid iti apuy ken Jehova."
		},
		"3": {
			"1": "<sup>1</sup> Ket no ti idatonna maysa a sacrificio dagiti datdaton iti cappia; no mangidaton cadagiti vacvaca, uray calakian, uray cabayan, ti awan pilawna ti idatonnanto iti saclang ni Jehova.",
			"2": "<sup>2</sup> Ket pataynanto ti imana iti rabaw ti olo ti idatonna, ket patayennanto iti ruangan ti tolda ti gimong: ket dagiti papadi nga annac ni Aaron iwarisdanto ti dara iti lawlaw ti rabaw ti altar.",
			"3": "<sup>3</sup> Ket idatagnanto a daton cadagiti datdaton iti cappia ti maysa a daton a maaramid iti apuy ken Jehova; ti taba a mangcumot cadagiti lalaem, ken amin a taba nga adda cadagiti lalaem,",
			"4": "<sup>4</sup> Ket dagiti dua a bekel ken ti taba iti lawlawda, nga adda iti abay dagiti lomo, ken ti culapot ti dalem, agraman dagiti beckel iccatennanto.",
			"5": "<sup>5</sup> Ket dagiti annac a lallaki ni Aaron puurandanto iti rabaw ti altar iti ngatoen ti mapuuran a daton, nga adda iti rabaw ti naisungrod iti apuy: isu ti maysa a daton a maaramid iti apuy, a nabanglo a sayamusom ken Jehova.",
			"6": "<sup>6</sup> Ket no ti idatonna a sacrificio dagiti datdaton iti cappia ken Jehova maysa cadagiti carcarnero; calakian wenno cabayan, nga awan pilawna ti pagdatonna.",
			"7": "<sup>7</sup> No ipaayna a daton ti cordero, idatonnanto ngarud iti saclang ni Jehova;",
			"8": "<sup>8</sup> Ket ipataynanto ti imana iti rabaw ti olo ti datonna, ket patayennanto iti sango ti tolda ti gimong: ket dagiti annac a lallaki ni Aaron iwarisdanto ti darana iti lawlaw ti rabaw ti altar.",
			"9": "<sup>9</sup> Ket ipaaynanto iti sacrificio dagiti datdaton iti cappia ti maysa a daton a maaramid iti apuy ken Jehova; ti tabana, ti nalucmeg nga ipus a sibubukel iccatennanto iti yan ti duri; ket ti taba a mamungon cadagiti lalaem, ken amin a taba nga adda cadagiti lalaem,",
			"10": "<sup>10</sup> Ket dagiti dua a beckel, ken ti taba nga adda cadacuada a nayapiring cadagiti lomo, ken ti culapot ti dalem, agraman dagiti beckel iccatennanto.",
			"11": "<sup>11</sup> Ket ti padi puurannanto iti rabaw ti altar: isu ti taraon ti daton a maaramid iti apuy ken Jehova.",
			"12": "<sup>12</sup> Ket no ti idatonna maysa a calding, idatonnanto ngarud iti saclang ni Jehova:",
			"13": "<sup>13</sup> Ket ipataynanto ti imana iti rabaw ti olona, ket patayennanto iti sango ti tolda ti gimong; ket dagiti annac a lallaki ni Aaron iwarisdanto ti darana iti rabaw ti altar nga aglawlaw.",
			"14": "<sup>14</sup> Ket mangipaayto iti daydiay ti datonna, nga maysa a daton a maaramid iti apuy ken Jehova; ti taba a mangcumot iti lalaem, ken amin a taba cadagiti lalaem,",
			"15": "<sup>15</sup> Ket dagiti dua a beckel, ken ti taba nga adda cadacuada a nayapiring cadagiti lomo, ken ti culapot, agraman dagiti beckel iccatennanto.",
			"16": "<sup>16</sup> Ket ti padi puurannanto ida iti rabaw ti altar: isu ti taraon ti daton a maaramid iti apuy, a nabanglo a sayamusom; dagup ti taba biang ni Jehova.",
			"17": "<sup>17</sup> Daytoy ti agnanayonto nga alagaden agpapan putputotyo iti isu-amin a pagnaedanyo, isu a dicayto canen ti taba ken dara."
		},
		"4": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel, a cunam, No addanto macabasol a dina gagaraen iti maysa cadagiti saan nga aramiden nga imbilin ni Jehova, ket aramidennanto ti maysa cadagidiay:",
			"3": "<sup>3</sup> No ti napulotan a padi macabasolto isu a pacairamananto ti ili, mangidaton ngarud gapu iti basolna nga inaramidna, iti maysa a bumaro a vaca nga awan pacapilawanna ken Jehova, a maipaay a daton gapu iti basol.",
			"4": "<sup>4</sup> Ket mangyegto iti vaca a bumaro iti ruangan ti tolda ti gimong iti sango ni Jehova; ket ipataynanto ti imana iti rabaw ti olo ti vaca, ket patayennanto ti vaca iti sango ni Jehova.",
			"5": "<sup>5</sup> Ket ti napulotan a padi alaennanto ti dara ti vaca, ket yegnanto iti tolda ti gimong:",
			"6": "<sup>6</sup> Ket ti padi ibabasananto ti ramayna iti dara, ket iwarisnanto ti dara iti maminpito iti saclang ni Jehova iti sangoanan ti abbong ti santuario.",
			"7": "<sup>7</sup> Ket ti padi icabilnanto ti dadduma a dara cadagiti sarsara ti altar ti incienso a nasayamusom iti sango ni Jehova, nga adda iti tolda ti gimong; ket ti dagup ti dara ti bumaro a vaca ibuyatnanto iti puon ti altar ti daton a mapuuran, nga adda iti ruangan ti tolda ti gimong.",
			"8": "<sup>8</sup> Ket amin a taba ti vaca a daton gapu ti basol iccatennanto; ti taba a mangbungon cadagiti lalaem, ken amin a taba cadagiti lalaem,",
			"9": "<sup>9</sup> Ket dagiti dua a beckel, ken ti taba nga adda iti rabawda, a nayapiring cadagiti lomo, ken ti culapot ti dalem, agraman dagiti beckel, iccatennanto.",
			"10": "<sup>10</sup> A cas panangiccat ti taba iti vaca a lalaki ti sacrificio dagiti daton iti cappia: ket ti padi puurannanto ida iti rabaw ti altar ti daton a mapuuran.",
			"11": "<sup>11</sup> Ket ti lalat ti vaca ken amin a lasagna, agraman ti olona ken agraman sacsacana, ken lalaemna, ken tackina,",
			"12": "<sup>12</sup> Uray ti dagup ti bagi ti vaca ipannanto iti ruar ti pacarso agingga iti nadalus a yan, a pacaiccan dagiti dapo, ket puurannanto iti rabaw ti sungrod iti apuy: iti pacaibellengan dagiti dapo isu ti pacapuurannanto.",
			"13": "<sup>13</sup> Ket no ti amin a gimong ti Israel macabasol, ket ti aramid nalmeng cadagiti matmata ti gimong, ket isuda nagaramidda cadagiti imbilin ni Jehova a saan nga aramiden, ket nacabasolda;",
			"14": "<sup>14</sup> No ti basol a nacabiddutanda maammoan, ti gimong ngarud idatonnanto ti maysa a vaca a bumaro nga agservi a daton gapu iti basol, ket yegna iti sango ti tolda ti gimong.",
			"15": "<sup>15</sup> Ket dagiti panglacayen ti gimong ipataydanto dagiti im-imada iti rabaw ti olo ti vaca iti saclang ni Jehova; ket ti vaca mapatayto iti sango ni Jehova.",
			"16": "<sup>16</sup> Ket ti napulotan a padi yegnanto ti dadduma a dara ti vaca iti tolda ti gimong:",
			"17": "<sup>17</sup> Ket ti padi isawsawnanto ti ramayna iti dara, ket iwarisnanto iti maminpito iti saclang ni Jehova iti sangoanan ti abbong.",
			"18": "<sup>18</sup> Ket icabilnanto ti dadduma a dara iti rabaw dagiti sarsara ti altar nga adda iti sango ni Jehova, nga adda iti uneg ti tolda ti gimong; ket amin ti dara ibucbucnanto iti puon ti altar ti daton a mapuuran, nga adda iti ruangan ti tolda ti gimong.",
			"19": "<sup>19</sup> Ket iccatennanto ti dagup ti tabana, ket puurannanto iti rabaw ti altar.",
			"20": "<sup>20</sup> Castoy ti aramidennanto iti vaca; cas inaramidna iti vaca ti daton gapu iti basol, castanto ti panangaramidna iti daytoy, ket ti padi aramidennanto ti pacaabbongan ti ili, ket mapacawandanto.",
			"21": "<sup>21</sup> Ket alaennanto ti vaca iti ruar ti pacarso, ket puurannanto a cas pinangpuurna idi immuna a vaca: isu ti daton gapu iti basol nga maipaay iti gimong.",
			"22": "<sup>22</sup> No maysa nga agturay ti macabasol, ket aramidenna a di gagaraen ti uray ania a di aramiden, cadagiti imbilin ni Jehova a Diosna ket nacabasol;",
			"23": "<sup>23</sup> No ti babacna a nacabasolanna maipacaammo kencuana, yegnanto a datonna ti maysa a calding, a lalaki nga awan pilawna;",
			"24": "<sup>24</sup> Ket ipataynanto ti imana iti rabaw ti olo ti calding, ket patayennanto iti disso a pamatpatayanda iti daton a mapuuran iti saclang ni Jehova: isu ti maysa a daton gapu iti basol.",
			"25": "<sup>25</sup> Ket ti padi isawsawnanto ti ramayna iti dara ti daton gapu iti basol, ket icabilnanto iti rabaw dagiti sarsara ti altar ti daton a mapuuran; ket ti darana ibuyatnanto iti puon ti altar ti daton a mapuuran.",
			"26": "<sup>26</sup> Ket dagup ti tabana puurannanto iti rabaw ti altar, cas ti taba ti sacrificio dagiti datdaton a maipaay iti cappia; ket ti padi aramidennanto a pacaabbonganna cas mayannatup iti basolna, ket mapacawanto.",
			"27": "<sup>27</sup> Ket no maysa cadagiti tattao a caaduan ti macabiddut a dina gagaraen, no agaramid iti maysa cadagiti saan nga aramiden nga imbilin ni Jehova, ket macabasol;",
			"28": "<sup>28</sup> No ti basolna a nacabiddutanna maipacaammo kencuana, yegnanto ngarud a datonna ti maysa a calding, cabayan nga awan pacapilawanna, gapu iti basol a nacabiddutanna.",
			"29": "<sup>29</sup> Ket ipataynanto ti imana iti rabaw ti olo ti daton gapu iti basol, ket patayennanto ti daton gapu iti basol iti yan ti daton a mapuuran.",
			"30": "<sup>30</sup> Ket ti padi isawsawnanto ti ramayna iti dara daydiay, ket icabilnanto cadagiti sarsara ti altar ti daton a mapuuran; ket dagup ti dara daydiay ibuyatnanto iti puon ti altar.",
			"31": "<sup>31</sup> Ket amin a tabana iccatennanto, cas pannacaiccat ti taba iti sacrificio dagiti datdaton a maipaay iti cappia; ket ti padi puurannanto iti rabaw ti altar, a nabanglo a sayamusom ken Jehova; ket ti padi aramidennanto a pacaabbonganna, ket mapacawanto.",
			"32": "<sup>32</sup> Ket no mangyeg iti maysa a cordero a daton nga ipaayna gapu iti basol, maysa a cabayan nga awan pacapilawanna ti yegnanto.",
			"33": "<sup>33</sup> Ket ipataynanto ti imana iti rabaw ti olo ti daton gapu iti basol, ket patayennanto a daton gapu iti basol iti disso a pamatpatayanda iti daton a mapuuran.",
			"34": "<sup>34</sup> Ket ti padi isawsawnanto ti ramayna iti dara ti daton gapu iti basol, ket icabilnanto iti rabaw dagiti sarsara ti altar ti daton a mapuuran; ket amin a dara daydiay ibuyatnanto iti puon ti altar:",
			"35": "<sup>35</sup> Ket amin a tabana iccatennanto, cas iti pannacaiccat ti taba ti cordero iti sacrificio dagiti datdaton a maipaay iti cappia; ket ti padi puurannanto ida iti rabaw ti altar, iti ngatoen dagiti datdaton a maaramid iti apuy ken Jehova ket ti padi aramidennanto a pacaabbonganna a maipanggep iti basolna a nacabiddutanna, ket mapacawanto."
		},
		"5": {
			"1": "<sup>1</sup> Ket no maysa a tao macabasol, iti panangdengngegna iti timec ti panamagsapata, isu a sacsi, uray no nakitana wenno naammoanna, no dina ibaga, isunto ngarud ti mangawit iti kinadakes.",
			"2": "<sup>2</sup> Wenno uray siasinoman a mangsagid iti saan a nadalus, uray bangcay ti natay nga animal a narugit wenno bangcay ti animal a naamo a narugit, wenno bangcay dagiti aguy-uyas a saan a nadalus, ket ilimedna, ket agtaeng a saan a nadalus, macabasolto ngarud.",
			"3": "<sup>3</sup> Wenno no sagidenna ti rugit ti tao, iti uray ania a nacarugitanna, ket ilimedna; intono maammoan, macabiddutto laeng.",
			"4": "<sup>4</sup> Wenno no ti uray siasino mangipabpabareng nga agsapata cadagiti bibigna nga agaramid iti dakes, wenno agaramid iti naimbag, uray aniaman a balicsennanto a situtured babaen ti sapata, ket ilimedna; intono maammoan, macabiddutto ngarud iti maysa cadagitoy nga aramid.",
			"5": "<sup>5</sup> Ket maaramidto, a no isu macabasolto iti maysa cadagitoy nga aramid, ipudnonanto ti basol nga inaramidna:",
			"6": "<sup>6</sup> Ket yegnanto a datonna gapu iti salungasing ken Jehova nga agservi iti basol a nacabasolanna, ti maysa a cabayan iti pangen, maysa a cordero wenno maysa a calding, a daton gapu iti basol; ket ti padi aramidennanto a paccaabbonganna a maipanggep iti basolna.",
			"7": "<sup>7</sup> Ket no di macaanay ti cucuana a pangpaadda iti maysa a cordero, yegnanto ngarud a datonna gapu iti salungasing nga agservi iti nacabasolanna, ti dua a pagaw wenno dua a calapati nga urbon, ken Jehova; ti maysa maipaay ti daton gapu iti basol, ket ti sabali maipaay ti daton a mapuuran.",
			"8": "<sup>8</sup> Ket ipannanto ida iti padi, isu a mangipaayto nga umuna iti dayta a daton gapu iti basol, ket pulsotennanto ti olona iti tengngedna, ngem dinanto gudduaen:",
			"9": "<sup>9</sup> Ket iwarisnanto ti dadduma iti dara ti daton gapu iti basol iti sikigan ti altar; ket ti natda iti dara maipatedtedto iti puon ti altar: isu ti maysa a daton gapu iti basol.",
			"10": "<sup>10</sup> Ket idatagnanto ti maicadua a daton a mapuuran, cas iti alagaden; ket ti padi aramidennanto a pacaabbonganna a mayannurot iti biddut a nacabasolanna, ket mapacawanto.",
			"11": "<sup>11</sup> Ngem no awan kencuana ti macaanay a pamaaddana iti dua a pagaw wenno dua a calapati, yegnanto ngarud a datonna gapu iti pannacabasolna, ti apagcapulo ti maysa nga efa ti namayecmec nga harina a pagdaton gapu iti basol: dinanto ic-iccan iti lana, casta met a dinanto ic-iccan iti incienso; ta isu ti maysa a daton gapu iti basol.",
			"12": "<sup>12</sup> Ket ipannanto iti padi, ket ti padi rumakemto iti harina a pacalaglagipanna, ket puurannanto iti altar, a ngatoen dagiti datdaton a maaramid iti apuy ken Jehova: isu ti maysa a daton gapu iti basol.",
			"13": "<sup>13</sup> Ket ti padi aramidennanto a pacaabbonganna mayannatup iti babacna a nacabasolanna iti uray ania cadagitoy, ket mapacawanto: ket ti natda cucuanto ti sacerdote, a cas ti daton a canen.",
			"14": "<sup>14</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"15": "<sup>15</sup> No uray siasinoman mailaw-an a macasalungasing, ket macabasol a dina gagaraen cadagiti nasantoan a ramitramit ni Jehova; yegnanto ngarud ti idatonna gapu iti salungasing ken Jehova, ti maysa a lalaki a carnero nga awan pilawna, a mayannatup iti pamatgam iti pirac a siclo, a cas ti siclo ti santuario, nga agservi a daton gapu iti salungasing:",
			"16": "<sup>16</sup> Ket isublinanto iti nagaramidanna ti biddut iti nasantoan a ramramit, ket nayonannanto daydiay iti apagcalima nga apag, ket itednanto iti padi; ket ti padi aramidennanto a pacaabbonganna nga aramatenna ti carnero a lalaki a daton gapu iti salungasing, ket mapacawanto.",
			"17": "<sup>17</sup> Ket no ti maysa a tao macabasol, ket aramidenna ti maysa cadagiti saan nga aramiden nga imbilin ni Jehova; uray dina ammo, macabasol laeng, ket awitennanto ti kinadakesna.",
			"18": "<sup>18</sup> Ket ipannanto iti padi ti maysa a lalaki a carnero nga awan pilawna, a mayannatup iti pamatgam, nga agservi a daton gapu iti salungasing; ket ti padi aramidennanto a pacaabbonganna a maipaay iti aramid a nacabiddutanna a dina ginagara ken dina ammo, ket mapacawanto.",
			"19": "<sup>19</sup> Isu ti maysa a daton gapu iti salungasing: ti tao kinapudnona a nacabiddut iti saclang ni Jehova."
		},
		"6": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> No ti maysa a tao macabasol, ket mailaw-an a sumalungasing ken Jehova, ket ulbodenna ti padana a tao iti naitalec, wenno iti nagtulaganda, wenno iti tacaw, wenno pinarigatna ti padana a tao,",
			"3": "<sup>3</sup> Wenno nasaracanna ti napucaw, ket yulbodna, ket sapataanna iti tiri; iti uray ania cadagitoy a banbanag nga aramiden ti tao, isu ti pacabasolan;",
			"4": "<sup>4</sup> Agbanagto ngarud a no nacabasol, ket sibibiddut, isublinanto ti tinacawna, wenno nagun-odna gapu iti pammarparigatna, wenno ti naitalec kencuana, wenno ti napucaw a nasaracanna,",
			"5": "<sup>5</sup> Wenno aniaman a sinapataanna iti tiri, isublinanto met laeng nga awan macsay, ket nayonannanto pay iti apagcalimana: ket ti agtagicua isu ti pangitedannanto iti aldaw a pannacasaracna iti nacabaddutanna.",
			"6": "<sup>6</sup> Ket yegnanto iti padi ti daton ken Jehova gapu iti salungasing, maysa a carnero a lalaki nga awan pacapilawanna, a maitutop iti cas pamatpatgam, nga agservi a daton gapu iti salungasing:",
			"7": "<sup>7</sup> Ket ti padi aramidennanto a pacaabbonganna iti sango ni Jehova; ket mapacawanto iti uray ania nga inaramidna nga nacabasolanna.",
			"8": "<sup>8</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"9": "<sup>9</sup> Ibilinmo ken Aaron ken cadagiti annacna a lallaki, a cunam, Daytoy ti alagaden iti daton a mapuuran: ti daton a mapuuran addanto iti pagsungrodan iti rabaw ti altar iti agpatpatnag agingga iti bigat; ket ti apuy ti altar mapaspasgedanto laeng iti rabawna.",
			"10": "<sup>10</sup> Ket ti padi icapetnanto ti badona a lienzo, ket dagiti sapinna a lienzo icapetnanto iti bagina; ket iccatennanto dagiti dapo, apaman a naibus ti apuy ti daton a mapuuran iti rabaw ti altar, ket icabilnanto ida iti sikigan ti altar.",
			"11": "<sup>11</sup> Ket iccatennanto dagiti cawcawesna, ket icapetnanto dagiti sabali a cawcawes, ket yallatiwnanto dagiti dapdapo iti ruar ti pacarso iti nadalus a disso.",
			"12": "<sup>12</sup> Ket ti apuy iti rabaw ti altar mabatinto a sidadarang idiay, daytoy dinto maiddep; ket ti padi sungsungrodannanto iti biniganbigat; ket icabilnanto a siuurnos iti rabawna ti daton a mapuuran, ket puurannanto idiay ti taba dagiti daton a maipaay iti cappia.",
			"13": "<sup>13</sup> Ti apuy mabatinto laeng a sidadarang nga agnanayon iti rabaw ti altar; daytoy dinto maiddep.",
			"14": "<sup>14</sup> Ket daytoy ti alagaden iti daton a macan: dagiti annac a lallaki ni Aaron idatondanto iti saclang ni Jehova, iti sango ti altar.",
			"15": "<sup>15</sup> Ket mangalanto iti sangarakemna iti daydiay, iti namayecmec nga harina ti daton a canen, ken iti dadduma a lanana, ken dagup ti incienso nga adda iti daton a bel-laay, ket puurannanto iti rabaw ti altar nga agservi a nabanglo a sayamusom, cas pacalaglagipanna, ken Jehova.",
			"16": "<sup>16</sup> Ket ti matda iti daydiay canento ni Aaron ken dagiti annacna a lallaki: macanto a di-nalevaduraan iti maysa a nasantoan a disso; iti paraangan ti tolda ti gimong canendanto.",
			"17": "<sup>17</sup> Dinto maluto a silelevadura iti horno. Intedco a cas bagida cadagiti datdaton caniac, iti maaramidto iti apuy; daytoy ti nasantoan unay, a cas ti daton gapu iti basol, ken cas ti daton gapu iti salungasing.",
			"18": "<sup>18</sup> Tumunggal maysa a lalaki cadagiti annac ni Aaron canennanto cas bagina nga agnanayon cadagiti putputotyo, cadagiti datdaton ken Jehova iti maramid iti apuy: ti mangsagid cadagidiay nasantoanto.",
			"19": "<sup>19</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"20": "<sup>20</sup> Daytoy ti daton ni Aaron ken dagiti annacna a lallaki, nga ipaaydanto ken Jehova iti aldaw a pannacasapsapona: ti apagcapulo ti maysa nga efa ti namayecmec nga harina a maipaay a mataginayon a daton a bel-laay, ti cagudduana iti bigat ket ti maysa a gudduana iti malem.",
			"21": "<sup>21</sup> Iti maysa a bandeja ti horno maaramidto a silalana; no maupran yunegmonto: ti mapispisi a naluto idatonmonto ti daton a canen, nga agservi, a nabanglo a sayamusom ken Jehova.",
			"22": "<sup>22</sup> Ket ti padi a napulotan a sumononto kencuana cadagiti annacna a lallaki idatonnanto: gapu iti mataginayon a pagbilinan, mapuuranto nga awan ti curangna a maipaay ken Jehova.",
			"23": "<sup>23</sup> Ket tunggal daton a canen ti padi mapuuranto nga awan ti curangna: dinto macan.",
			"24": "<sup>24</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"25": "<sup>25</sup> Ibagam ken Aaron ken cadagiti annacna a lallaki, a cunam, Daytoy ti alagaden iti panagdaton gapu iti basol: iti disso a pamatpatayan iti daton a mapuuran, isunto met ti pamapatayan iti daton gapu iti basol iti saclang ni Jehova isu ti nasantoan unay.",
			"26": "<sup>26</sup> Ti padi a mangidaton itoy gapu iti basol, canennanto: iti maysa a disso a nasantoan isu panganannanto, iti paraangan ti tolda ti gimong.",
			"27": "<sup>27</sup> Uray aniaman a macasagid iti lasag iti daytoy, nasantoanto; ket no mawarsian ti darana iti uray ania a cawes, labaamto ti nawarsian iti maysa a disso a nasantoan.",
			"28": "<sup>28</sup> Ngem ti damili a nacalutoanna boongento; ket no suer nga alicamen ti nacalutoanna, maugasanto, ket mabuggoanto iti danum.",
			"29": "<sup>29</sup> Tunggal lalaki cadagiti papadi canennanto daydiay: isu ti nasantoan unay.",
			"30": "<sup>30</sup> Ket saan a macan ti daton gapu iti basol, no ti dadduma a darana naiserrec iti tolda ti gimong, tapno maaramid a pacaabbongan iti nasantoan a disso: mapuuranto iti apuy."
		},
		"7": {
			"1": "<sup>1</sup> Ket daytoy ti alagaden ti panagdaton gapu iti salungasing: isu ti nasantoan unay.",
			"2": "<sup>2</sup> Iti disso a pamatpatayanda iti daton a mapuuran ti pamapatayanda iti daton gapu iti salungasing; ket ti dara daytoy iwarisnanto iti lawlaw ti rabaw ti altar.",
			"3": "<sup>3</sup> Ket idatonnanto itoy ti dagup ti tabana: ti nalucmeg nga ipus, ken ti taba a mangcumot cadagiti lalaem,",
			"4": "<sup>4</sup> Ken ti dua a beckel, ken ti taba nga adda cadacuada iti apiring dagiti lomo, ken ti culapot ti dalem agraman cadagiti beckel iccatennanto;",
			"5": "<sup>5</sup> Ket ti padi puurannanto ida iti rabaw ti altar a maysa a daton a maaramid iti apuy ken Jehova: isu ti maysa a daton gapu iti salungasing.",
			"6": "<sup>6</sup> Tunggal lalaki cadagiti papadi manganto iti daydiay; iti nasantoan a disso ti pangananto: isu nasantoan unay.",
			"7": "<sup>7</sup> Cas iti daton gapu iti basol, casta met ti daton gapu iti salungasing, maymaysa nga alagaden ti pacawadanda: ti padi a mangaramid iti daydiay a pacaabbongan, cucuananto.",
			"8": "<sup>8</sup> Ket ti padi a mangirucbab iti daton a mapuuran ti maysa a tao, ti padi met laeng tagicuaennanto ti lalat ti maidaton a mapuuran nga impaayna.",
			"9": "<sup>9</sup> Ket tunggal daton a canen a maluto iti horno, ken amin a maluto iti parioc ken iti bandeja ti horno, cucuanto ti padi a mangidaton.",
			"10": "<sup>10</sup> Ket tunggal daton a macan a nalaocan iti lana, wenno namaga, cucuanto amin dagiti annac a lallaki ni Aaron, nga cas iti bingay ti maysa, casta met ti bagi ti sabali.",
			"11": "<sup>11</sup> Ket daytoy ti alagaden ti sacrificio cadagiti datdaton a maipaay ti cappia nga idatagto ti maysa a tao ken Jehova.",
			"12": "<sup>12</sup> No isu yawatnanto a pagyaman, idatonnanto ngarud ti namayecmec a bel-laay a buyugen ti sacrificio a pagyaman dagiti saan a nalevaduraan a bibingca a nalaocan iti lana, ken di-nalevaduraan a cancanen a nasapsapoan iti lana, ken tortorta a nalaocan iti lana.",
			"13": "<sup>13</sup> Agraman dagiti bibingca ti tinapay a nalevaduraan, idatagnanto ti datonna a buyugen ti sacrificio dagiti datdatonna a maipaay iti capia a pagyaman.",
			"14": "<sup>14</sup> Ket iti daydiay ipaaynanto ti maysa iti tunggal daton, nga agservi a daton a maitayag ken Jehova; daytoy cucuanto ti padi a mangiwarsi iti dara dagiti datdaton iti cappia.",
			"15": "<sup>15</sup> Ket ti lasag ti sacrificio dagiti idatonna iti cappia a pagyaman macanto iti aldaw panagidatonna; awanto ti matda agingga iti bigat.",
			"16": "<sup>16</sup> Ngem no ti sacrificio ti datonna maysa a cari, wenno ti maysa a daton ti sibubulos a nakem, macanto iti aldaw a panangipaayna iti datonna; ket ti cabigatanna canennanto ti tiddana: isu ti pannacacaanto ti matda:",
			"17": "<sup>17</sup> Ngem ti mabati iti lasag ti sacrificio agingga iti maicatlo nga aldaw, mapuuranto iti apuy.",
			"18": "<sup>18</sup> Ket no adda uray ania a lasag iti sacrificio dagiti datdatonna a maipaay iti cappia a canenna iti maicatlo nga aldaw, saanto a maawat, dinto met maibilang kencuana a nangidatag iti daton: maysanto a rimon, ket ti cararua ti mangan awitennanto ti kinadakesna.",
			"19": "<sup>19</sup> Ket ti lasag a maisagid iti uray aniaman a saan a nadalus, saan a canen; mapuuranto iti apuy. Ket no maipapan iti lasag tumunggal maysa a nadalus manganto iti daytoy:",
			"20": "<sup>20</sup> Ngem ti tao a mangan iti lasag ti sacrificio dagiti datdaton iti cappia, a maipaay ken Jehova, idinto a sirurugit, dayta a tao maipusayto iti ilina.",
			"21": "<sup>21</sup> Ket no addanto maysa a macasagid iti uray ania a narugit, ti kinarugit ti tao wenno kinarugit ti animal, wenno maysa a nacarimrimon a rugit, ket mangan iti lasag ti sacrificio dagiti datdaton iti cappia, a maipaay ken Jehova, dayta a tao maipusayto iti ilina.",
			"22": "<sup>22</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"23": "<sup>23</sup> Ibagam cadagiti annac ti Israel, a cunam, Dicayto mangan iti taba ti vaca, wenno carnero, wenno calding.",
			"24": "<sup>24</sup> Ket ti taba ti matay latta, ken ti taba ti pinisangpisang dagiti narungsot nga animal, mabalin nga aramaten iti uray ania a pacaipayanna; ngem uray caano dicayto mangan iti dayta.",
			"25": "<sup>25</sup> Ta ti uray siasinoman a mangan iti taba ti animal a mapuuran a dagiti tattao idatagda a daton iti apuy ken Jehova, uray daydiay a tao a mangan iti dayta maipusayto iti ilina.",
			"26": "<sup>26</sup> Ket dacayo dicayto mangan a pulos iti dara, uray dara ti tumatayab wenno animal iti uray sadino a pagnaedanyo.",
			"27": "<sup>27</sup> Siasinoman a mangan iti uray ania a dara, dayta a tao maipusayto iti ilina.",
			"28": "<sup>28</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"29": "<sup>29</sup> Ibagam cadagiti annac ti Israel, a cunam, Ti mangidatag iti sacrificio dagiti datdatonna gapu iti cappia ken Jehova, yegnanto ti datonna iti sacrificio dagiti datdatonna gapu iti cappia ken Jehova:",
			"30": "<sup>30</sup> Dagiti imana met laeng ti mangyegto cadagiti datdaton a mapuuran iti apuy ken Jehova; ti taba agraman ti barucong yegnanto, tapno ti barucong mailili cas daton a maitayag iti sango ni Jehova.",
			"31": "<sup>31</sup> Ket ti padi puurannanto ti taba iti rabaw ti altar; ngem ti barucong cucuanto ni Aaron ken dagiti annacna a lallaki.",
			"32": "<sup>32</sup> Ket ti luppo a macanawan itedyonto iti padi a maipaay a daton a maitayag cadagiti sacrificio dagiti datdatonyo iti cappia.",
			"33": "<sup>33</sup> Ti anac a lalaki ni Aaron a mangirucbab ti dara dagiti datdaton iti cappia, ken ti taba, cucuananto ti macanawan a luppo a pannacabagina.",
			"34": "<sup>34</sup> Ta ti barucong a mailili ken ti luppo a maitayag, innalac cadagiti annac ti Israel cadagiti sacrificio dagiti datdatonda a maipaay iti cappia, ket intedco ken Aaron a padi ken cadagiti annacna a lallaki cas pannacabagida nga agnanayon nga aggapu cadagiti annac ti Israel.",
			"35": "<sup>35</sup> Daytoy ti pannacabagi ni Aaron a napolutan ken ti pannacabagi dagiti annacna a lallaki ta napolutanda, cadagiti datdaton a naaramid iti apuy ken Jehova iti aldaw a panangidatagna cadacuada tapno agannongda ken Jehova iti akem ti padi,",
			"36": "<sup>36</sup> Isu a imbilin ni Jehova a maited a pannacabagida cadagiti annac ti Israel, iti aldaw a panangpulotna cadacuada. Isu ti pannacabagida nga agnanayon cadagiti capcaputotanda.",
			"37": "<sup>37</sup> Daytoy ti alagaden iti daton a mapuuran, iti daton a macan, ken iti daton gapu iti basol, ken iti daton gapu iti salungasing, ken ti pannacaconsagrar, ken iti panangidatag cadagiti datdaton iti cappia;",
			"38": "<sup>38</sup> Nga ni Jehova imbilinna ken Moises idiay bantay Sinai, iti aldaw a panangbilinna cadagiti annac ti Israel nga ipaayda dagiti datdatonda ken Jehova, idiay tay-ac ti Sinai."
		},
		"8": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Alaem ni Aaron ken agraman dagiti annacna a lallaki, ken dagiti cawcawes, ken ti lana a pagsapsapo, ken ti vaca a lalaki a daton gapu iti basol, ken dagiti dua a lallaki a carnero, ken ti labba ti di-nalevaduraan a tinapay;",
			"3": "<sup>3</sup> Ket tiptiponem amin ti gimong iti ruangan ti tolda ti gimong.",
			"4": "<sup>4</sup> Ket ni Moises inaramidna ti cas imbilin kencuana ni Jehova; ket ti gimong natiptiponda iti ruangan ti tolda ti gimong.",
			"5": "<sup>5</sup> Ket ni Moises kinunana iti gimong, Daytoy ti aramid nga aramiden nga imbilin ni Jehova.",
			"6": "<sup>6</sup> Ket ni Moises innalana ni Aaron ken dagiti annacna a lallaki, ket binuggoanna ida iti danum.",
			"7": "<sup>7</sup> Ket incabilna kencuana ti bado ket binaricsanna iti barikes, ket incapetna ti cagay kencuana, ket inlusong ti efod kencuana, sana incapet ti barikes ti efod a nasayaat ti pannacaabelna, isu ti pinanggalutna ti efod kencuana.",
			"8": "<sup>8</sup> Ket insaadna kencuana ti pectoral, ket iti uneg ti pectoral incabilna ti Urim ken ti Tummim.",
			"9": "<sup>9</sup> Ket insaadna ti mitra iti olona; ket iti sangoananna, iti mitra, incabilna ti pinitpit a balitoc, ti nasantoan a balangat; cas imbilin ni Jehova ken Moises.",
			"10": "<sup>10</sup> Ket ni Moises innalana ti pagsapsapo a lana, ken sinapsapoanna ti tabernaculo ken amin nga adda iti unegna, ket sinantificarna ida.",
			"11": "<sup>11</sup> Ket winarsianna iti daydiay ti rabaw ti altar iti naminpito a daras ket linanaanna ti altar, ken amin nga alicamenna, ken ti pagbuggoan ken ti batayna, tapno pasantoenna ida.",
			"12": "<sup>12</sup> Ket binuyatanna ti olo ni Aaron iti lana a pagsapsapo, ket pinulotanna tapno pasantoenna.",
			"13": "<sup>13</sup> Ket ni Moises innala dagiti annac a lallaki ni Aaron, ket kinawesanna ida cadagiti badbado, ket incapetna cadacuada dagiti barbarikes, ket imbedbedna cadagiti ol-oloda ti pannacacallogong; cas imbilin ni Jehova ken Moises.",
			"14": "<sup>14</sup> Ket inyegna ti vaca a lalaki ti daton gapu iti basol: ket da Aaron ken dagiti annacna a lallaki impatayda dagiti im-imada iti rabaw ti olo ti vaca a daton gapu iti basol.",
			"15": "<sup>15</sup> Ket pinatayna; ket ni Moises innalana ti dara, ket iti ramayna, incabilna cadagiti sarsara ti altar, ket ginugoranna ti altar, ket imbuyatna ti dara iti puon ti altar, ket pinasantona, tapno aramidenna ti pannacaabbongna.",
			"16": "<sup>16</sup> Ket innalana amin a taba nga adda cadagiti lalaem, ken ti culapot ti dalem, ken dagiti dua a beckel, ken ti tabada; ket ni Moises pinuuranna ida iti rabaw ti altar.",
			"17": "<sup>17</sup> Ngem ti vaca, ken ti lalatna, ken ti lasagna, ken ti tackina pinuuranna iti ruar ti pacarso; cas imbilin ni Jehova ken Moises.",
			"18": "<sup>18</sup> Ket indatagna ti carnero a lalaki ti daton a mapuuran ket ni Aaron ken dagiti annacna a lallaki impatayda dagiti im-imada iti rabaw ti olo ti carnero.",
			"19": "<sup>19</sup> Ket pinatayna; ket ni Moises inwarsina ti dara iti lawlaw ti rabaw ti altar.",
			"20": "<sup>20</sup> Ket rinangcayna ti carnero a lalaki; ket ni Moises pinuuranna ti olo, dagiti narangrangcay, ken ti taba.",
			"21": "<sup>21</sup> Ket binuggoanna iti danum dagiti lalaem ken dagiti sacsacana; ket ni Moises pinuuranna amin a bagi ti carnero iti rabaw ti altar; isu idi ti maysa a daton a mapuuran nga agservi a nabanglo a sayamusom: daytoy ti maysa a daton a naaramid iti apuy ken Jehova; cas imbilin ni Jehova ken Moises.",
			"22": "<sup>22</sup> Ket indatagna ti sabali a carnero a lalaki, ti carnero iti pannacaconsagrar: ket ni Aaron ken dagiti annacna a lallaki impatayda dagiti imada iti rabaw ti olo ti carnero.",
			"23": "<sup>23</sup> Ket pinatayna; ket ni Moises nangala iti dara daydiay ket incabilna iti rabaw ti tuctuc ti bolong ti lapayag a macanawan ni Aaron, ken iti tangan ti macanawan nga imana, ken rabaw ti tangan ti macanawan a sacana.",
			"24": "<sup>24</sup> Ket inyegna dagiti annac a lallaki ni Aaron; ket ni Moises incabilna ti nayon ti dara iti pantoc ti macanawan a laplapayagda, ken iti tangan dagiti im-imada a macanawan, ken iti tangan dagiti sacsacada a macanawan: ket ni Moises in-warsina ti dara iti lawlaw ti rabaw ti altar.",
			"25": "<sup>25</sup> Ket innalana ti taba, ken ti nalucmeg nga ipus, ken amin a taba nga adda cadagiti lalaem, ken ti culapot ti dalem, ken dagiti dua a beckel, ken ti tabada, ken ti macanawan a luppo:",
			"26": "<sup>26</sup> Ket iti labba ti tinapay a di-nalevaduraan nga adda iti sango ni Jehova, innalana ti maysa a bibingca a di-nalevaduraan, ken maysa a torta ti tinapay a nalanaan, ken maysa a cancanen, ket indissona ida iti taba ken iti macanawan a luppo:",
			"27": "<sup>27</sup> Ket incabilna amin iti ima ni Aaron ken cadagiti im-ima dagiti annacna sada inlili ida nga agservi a daton a maitayag iti sango ni Jehova.",
			"28": "<sup>28</sup> Ket ni Moises iniccatna dagidiay iti im-imada, ket pinuuranna ida iti rabaw ti altar iti ngatoen ti daton a mapuuran: daydiay ti maysa a pannacaconsagrar a nabanglo a sayamusom: isu idi ti maysa a daton a napuuran iti apuy ken Jehova.",
			"29": "<sup>29</sup> Ket ni Moises innalana ti barucong, ket inlilina a daton a maitayag iti sango ni Jehova: isu ti pannacabagi ni Moises iti carnero a lalaki ti pannacaconsagrar; cas imbilin ni Jehova ken Moises.",
			"30": "<sup>30</sup> Ket ni Moises nangala iti lana a pagsapsapo, ken iti dara nga adda iti altar, ket inwarsina ken Aaron, cadagiti cawcawesna, ken cadagiti annacna a lallaki, ken cadagiti cawcawes dagiti annacna a lallaki agraman kencuana, ket pinasantona ni Aaron dagiti cawcawesna, ken dagiti annacna a lallaki, ken dagiti cawcawes dagiti annacna a lallaki agraman kencuana.",
			"31": "<sup>31</sup> Ket ni Moises kinunana ken Aaron ken cadagiti annacna a lallaki, Lingtaenyo ti lasag iti ruangan ti tolda ti gimong: ket canenyo idiay ken ti tinapay nga adda iti labba ti pannacaconsagrar, cas imbilinco a kinunac, Ni Aaron ken dagiti annacna a lallaki canendanto daydiay.",
			"32": "<sup>32</sup> Ket ti matda iti lasag ken iti tinapay puuranyonto iti apuy.",
			"33": "<sup>33</sup> Ket iti pito nga aldaw dicayto pumanaw iti ruangan ti tolda ti gimong, inggana ti di-masungpot dagiti aldaw ti pannacaconsagraryo: ta isu consagrarennacayto iti pito nga aldaw.",
			"34": "<sup>34</sup> Cas ti pannacaaramidna daytoy nga aldaw, casta met ni Jehova imbilinna a maaramid, tapno aramiden ti pannacaabbong a maipaay cadacayo.",
			"35": "<sup>35</sup> Ket iti ruangan ti tolda ti gimong ti pagnaedanyonto nga agmalmalem ken agpatnag bayat dagiti pito nga al-aldaw, ket salimetmetanyonto ti imbilin ni Jehova, tapno dicayto matay: ta casta ti naibilin caniac.",
			"36": "<sup>36</sup> Ket ni Aaron ken dagiti annacna a lallaki inaramidda amin a pinaibilin ni Jehova ken Moises."
		},
		"9": {
			"1": "<sup>1</sup> Ket naaramid iti maicawalo nga aldaw nga ni Moises inayabanna ni Aaron ken dagiti annacna a lallaki, ken dagiti lallacay ti Israel;",
			"2": "<sup>2</sup> Ket kinunana ken Aaron, Alaem ti maysa nga urbon cadagiti vacvaca a maipaay a daton gapu iti basol, ken ti maysa a carnero a lalaki a maipaay a daton a mapuuran, nga awan pacapilawanda, ket idatonmo ida iti saclang ni Jehova.",
			"3": "<sup>3</sup> Ket ibagamto cadagiti annac ti Israel ket cunam, Mangalacayo iti maysa a calding a lalaki a daton gapu iti basol; ken maysa nga urbon a vaca ken maysa a cordero nga awan pacapilawanda, a saggaysa ti tawenda nga agservi a daton a mapuuran;",
			"4": "<sup>4</sup> Ken maysa a vaca a lalaki ken maysa a carnero a lalaki a datdaton iti cappia nga irucbab iti sango ni Jehova; ken maysa a daton a macan a nalaocan iti lana: ta ita nga aldaw ni Jehova agparang cadacayo.",
			"5": "<sup>5</sup> Ket inyegda ti imbilin ni Moises iti sango ti tolda ti gimong: ket amin ti gimong immadanida ket nagtacderda iti saclang ni Jehova.",
			"6": "<sup>6</sup> Ket ni Moises kinunana, Daytoy ti imbilin ni Jehova a rebbengyo nga aramiden: ket ti dayag ni Jehova agparangto cadacayo.",
			"7": "<sup>7</sup> Ket ni Moises kinunana ken Aaron, Umasidegca iti altar, ket ipaaymo ti datonmo gapu iti basol, ken ti datonmo a mapuuran, ket aramidem a pacaabbongam met laeng, ken iti ili; ket irucbabmo ti daton ti ili, ket aramidem a pacaabbonganda: cas imbilin ni Jehova.",
			"8": "<sup>8</sup> Idin ni Aaron immasideg iti altar, ket pinatayna ti urbon a vaca a daton gapu iti basol, isu maipaay kencuana met laeng.",
			"9": "<sup>9</sup> Ket dagiti annac a lallaki ni Aaron indatagda ti dara kencuana, ket isu insawsawna ti ramayna iti dara, sana incabil cadagiti sarsara ti altar, ket imbuyatna ti dara iti poon ti altar;",
			"10": "<sup>10</sup> Ngem ti taba, ken dagiti beckel, ken ti culapot ti dalem ti daton gapu iti basol pinuuranna iti rabaw ti altar; cas imbilin ni Jehova ken Moises.",
			"11": "<sup>11</sup> Ket ti lasag ken ti lalat pinuuranna iti apuy iti ruar ti pacarso.",
			"12": "<sup>12</sup> Ket pinatayna ti daton a mapuuran; ket dagiti annac a lallaki ni Aaron inyawatda kencuana ti dara ket isu inwarsina iti lawlaw ti rabaw ti altar.",
			"13": "<sup>13</sup> Ket isuda inyawatda kencuana ti daton a mapuuran a marangrangcay, ken ti olo: ket pinuuranna ida iti altar.",
			"14": "<sup>14</sup> Ket binuggoanna dagiti lalaem ken dagiti sacsaca, sana pinuuran ida iti ngatoen ti daton a mapuuran iti rabaw ti altar.",
			"15": "<sup>15</sup> Ket indatagna ti daton ti ili, ket innalana ti calding ti daton gapu iti basol a maipaay iti ili sana pinatay, ket indatonna gapu iti basol, cas iti immuna.",
			"16": "<sup>16</sup> Ket indatagna ti daton a mapuuran, ket indatonna cas mayannurot iti linteg.",
			"17": "<sup>17</sup> Ket indatagna ti daton a macan ket nangrakem itoy ket pinuuranna iti rabaw ti altar, a nayon ti daton a mapuuran ti bigat.",
			"18": "<sup>18</sup> Pinatayna met ti vaca a lalaki ken ti carnero a lalaki, isuda a sacrificio dagiti datdaton iti cappia, a naipaay iti ili: ket dagiti annac a lallaki ni Aaron inyawatda kencuana a dara nga inwarsina iti lawlaw ti rabaw ti altar.",
			"19": "<sup>19</sup> Ket ti taba ti vaca ken ti carnero, ti nalucmeg nga ipus, ken ti mamungon cadagiti lalaem, ken dagiti beckel, ken ti culapot ti dalem:",
			"20": "<sup>20</sup> Ket incabilda ti taba iti rabaw dagiti barucong, ket pinuuranna ti taba iti rabaw ti altar:",
			"21": "<sup>21</sup> Ket ni Aaron inlilina dagiti barbarucong ken ti macanawan a luppo, daton a maitayag iti sango ni Jehova; cas imbilin ni Jehova.",
			"22": "<sup>22</sup> Ket ni Aaron intayagna dagiti imana nga insango iti ili, ket binendicionanna ida; ket immulog iti nangidatonanna iti daton gapu iti basol, ken iti daton a mapuuran, ken cadagiti datdaton iti cappia.",
			"23": "<sup>23</sup> Ket da Moises ken Aaron simrecda iti tolda ti gimong, ket sada rimmuar, ket binendicionanda ti ili: ket ti dayag ni Jehova nagparang cadagiti amin a tattao.",
			"24": "<sup>24</sup> Ket ti apuy rimmuar iti sango ni Jehova, ket pinuuranna iti rabaw ti altar ti daton a mapuuran ken ti taba: ket idi nakita amin dagiti tattao, nagdir-ida, ket nagpaclebda."
		},
		"10": {
			"1": "<sup>1</sup> Ket ni Nadab ken ni Abiu, nga annac a lallaki ni Aaron, innalada tunggal maysa ti incensariona, ket iniccanda iti apuy, sada incabil ti incienso, ket indatonda ti sabali nga apuy ken Jehova, a dina imbilin cadacuada.",
			"2": "<sup>2</sup> Ket ti apuy rimmuar iti sango ni Jehova, ket inalun-unna ida, ket natayda iti sango ni Jehova.",
			"3": "<sup>3</sup> Idin ni Moises kinunana ken Aaron, Daytoy ti imbaga ni Jehova a kinunana, Siac masantificaracto cadagiti umasideg caniac, ket iti sango ti amin nga umili maglorificaracto. Ket ni Aaron nagulimec.",
			"4": "<sup>4</sup> Ket ni Moises inayabanna da Misael ken Elisafan, nga annac a lallaki ni Uzziel nga uliteg ni Aaron, ket kinunana cadacuada, Umasidegcayo, ket ipanawyo ditoy sango ti santuario iti ruar ti pacarso dagiti cacabsatyo.",
			"5": "<sup>5</sup> Iti casta immasidegda, ket impanda ida a sicacawes iti ruar ti pacarso; cas sinao ni Moises.",
			"6": "<sup>6</sup> Ket ni Moises kinunana ken Aaron, ken Eleazar, ken Itamar nga annacna a lallaki, Dicayo wacrayen ti booc ti oloyo, dicayo met pigisen ti cawcawesyo; tapno dicayo matay, ken tapno di-macapungtot iti dagup ti gimong: ngem baybay-anyo dagiti cacabsatyo, ti dagup ti ili nga Israel, leddaangenda ti puur a pinasged ni Jehova.",
			"7": "<sup>7</sup> Ket dacayo dicay rumrumuar iti ruangan ti tolda ti gimong, di la ket ta mataycayo; gapu ta ti lana ni Jehova a pagsapsapo adda cadacayo. Ket inaramidda ti mayannurot iti sao ni Moises.",
			"8": "<sup>8</sup> Ket ni Jehova nakisao ken Aaron a kinunana,",
			"9": "<sup>9</sup> Sica wenno dagiti annacmo a lallaki agraman kenca, dicay uminum iti arac wenno naingel nga inumen no sumreccayo iti tolda ti gimong, tapno dicay matay: daytoy maalagadto nga agnanayon cadagiti caputotanyo:",
			"10": "<sup>10</sup> Ken tapno mailasinyo ti nasantoan ken sapasap, ken ti saan a nadalus ken nadalus;",
			"11": "<sup>11</sup> Ken tapno isuroyo cadagiti annac ti Israel ti dagup dagiti al-alagaden nga imbaga ni Jehova iti ngiwat ni Moises.",
			"12": "<sup>12</sup> Ket ni Moises nakisao ken Aaron, ken Eleazar ken Itamar, nga annacna a lallaki a nabati, Alaenyo ti daton a macan a natda cadagiti datdaton a naaramid iti apuy ken Jehova, ket canenyo a di-nalevaduraan iti sibay ti altar; ta isu ti nasantoan unay;",
			"13": "<sup>13</sup> Ket canenyonto iti maysa a disso a nasantoan, gapu ta isu ti pannacabagim, ken pannacabagi dagiti annacmo a lallaki, cadagiti datdaton a naaramid iti apuy ken Jehova: ta casta ti naibilin caniac.",
			"14": "<sup>14</sup> Ket ti barucong a mailili ken ti maitayag a luppo canenyonto iti maysa a yan a nadalus; sica, ken dagiti annacmo a lallaki ken babbai agraman kenca: ta dagidiay maitedda a cas pannacabagim, ken pannacabagi dagiti annacmo, cadagiti sacrificio dagiti datdaton a maipaay iti cappia dagiti annac ti Israel.",
			"15": "<sup>15</sup> Ti maitayag a luppo ken ti mailili a barucong yegdanto agraman cadagiti datdaton a maaramid iti apuy ti taba, tapno mailili nga agservi a maysa a daton a maitayag iti sango ni Jehova: ket cucuamto, ken cucua dagiti annacmo agraman kenca a maysa a pannacabagi iti agnanayon; cas imbilin ni Jehova.",
			"16": "<sup>16</sup> Ket ni Moises sigaganetget a nagsapul iti calding ti daton gapu iti basol, ket, adtoy, napuuranen ket nagpungtot ken Eleazar ken Itamar, nabati nga annac a lallaki ni Aaron ket kinunana,",
			"17": "<sup>17</sup> Ania ti gapuna a dicay nangan ti daton gapu iti basol iti disso ti santuario, idinto nga isu nasantoan unay, ket intedna cadacayo a mangawit iti kinadakes ti gimong, tapno aramidenyo ti pannacaabbongda iti sango ni Jehova?",
			"18": "<sup>18</sup> Adtoy awan ti naiyeg nga darana: kinaagpaysona nacanyon coma a nayeg iti uneg ti santuario: iti santuario, cas imbilinco.",
			"19": "<sup>19</sup> Ket ni Aaron kinunana ken Moises, Adtoy, daytoy nga aldaw impaayda ti datonda gapu iti basol ken ti datonda a mapuuran iti sango ni Jehova; ket naipaayda caniac cas cadagitoy: ket no kinnanco coma ita ti daton gapu iti basol, nacaay-ayonto ngata coma iti imatang ni Jehova?",
			"20": "<sup>20</sup> Ket idi a ni Moises nanggegna daytoy, naparagsacan met laeng."
		},
		"11": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao cada Moises ken Aaron, a kinunana cadacuada,",
			"2": "<sup>2</sup> Ibagayo cadagiti annac ti Israel, a cunayo, Dagitoy dagiti nabiag a mabalinyo a canen cadagiti an-animal nga adda iti rabaw ti daga.",
			"3": "<sup>3</sup> Uray ania cadagiti an-animal a nagpisi ti cucuda, ken naggudua ti dapanna, ken agngatingat, mabalinyo a sidaen.",
			"4": "<sup>4</sup> Nupay casta dicayto sidsidaen dagitoy nga agngatingat, a nagpisi ti cucuda: ti camello, uray ta agngatingat, ngem saan a nagpisi ti cucuna, isu ti carugityo.",
			"5": "<sup>5</sup> Ket ti connejo, uray ta agngatingat ngem saan a nagguddua ti cucuna, isu ti carugityo.",
			"6": "<sup>6</sup> Ket ti liebre, ta agngatingat ngem saan a nagpisi ti cucuna, isu ti carugityo.",
			"7": "<sup>7</sup> Ket ti babuy, ta nagguddua ti cucuna, ket nagpisi ti dapanna, ngem saan nga agngatingat, isu carugityo.",
			"8": "<sup>8</sup> Iti lasag dagitoy dicayto agsida ket ti natay a bangcayda dicayto sagiden; carugityo ida.",
			"9": "<sup>9</sup> Dagitoy dagiti adda cadagiti dandanum a mabalinyonto a canen nga uray ania nga adda pigar ken sicsicna cadagiti dandanum, cadagiti baybay, ken cadagiti carcarayan, mabalinyo a sidaen.",
			"10": "<sup>10</sup> Ket dagup dagiti awan pigarna ken sicsicna iti baybay, ken iti carayan, iti dagup dagiti aggaraw cadagiti dandanum, ken iti amin dagiti nabiag nga adda cadagiti dandanum, carimonyo ida.",
			"11": "<sup>11</sup> Ket carimonyonto ida; dicayto sidaen dagiti lasagda, ket dagiti bangcayda a natay carimonyonto.",
			"12": "<sup>12</sup> Uray ania nga awanan pigar ken sicsicna cadagiti dandanum, dayta macarimon cadacayo.",
			"13": "<sup>13</sup> Ket cadagiti tumatayab carimonyonto dagitoy; saandanto a masida, nacarimrimonda: ti aguila, ken ti azor, ken ti aguila ti taaw,",
			"14": "<sup>14</sup> Ken ti gik-gik, ken ti sawi, ken ti cakitana,",
			"15": "<sup>15</sup> Amin a wac ken cakitana,",
			"16": "<sup>16</sup> Ken ti avestruz, ken ti calaw, ken ti garceta, ken ti cali ken cakitana,",
			"17": "<sup>17</sup> Ken ti puec, ken ti catili ken ti cullaaw.",
			"18": "<sup>18</sup> Ken ti calamon, ken ti pelicano, ken ti buitre,",
			"19": "<sup>19</sup> Ken ti tic-babuy, ken ti cannaway ken cakitana, ken abubilla, ken ti panniki.",
			"20": "<sup>20</sup> Amin dagiti an-animal a nagpayac nga agcaradapda cadagiti uppat a sacsacada, carimonyo dagita.",
			"21": "<sup>21</sup> Nupay casta mabalinyo a sidaen dagiti amin a nagpayac nga agcaradapda cadagiti uppat a sacada, nga adda luppoda, isu a paglagtoda iti daga;",
			"22": "<sup>22</sup> Uray dagitoy mabalinyo a sidaen ida: ti dudon ken cakitana, ti pattanglod ken cakitana, ken ti curiat ken cakitana, ken ti pattinggi ken cakitana.",
			"23": "<sup>23</sup> Ngem amin a nagpayac nga agcaradap nga uppat dagiti sacsacada, carimonyo ida.",
			"24": "<sup>24</sup> Ket gapu cadagitoy agbalincayto a narugit: siasinoman a mangsagid iti bangcayda a natay, saanto a nadalus agingga iti rumabii;",
			"25": "<sup>25</sup> Ket siasinoman a mangala iti sangcabassit a bagi ti natay cadagidiay, labaannanto ti pagan-anayna, ket dinto nadalus agpapan iti rumabii.",
			"26": "<sup>26</sup> Tunggal animal a nagpisi ti cucuna ket saan a nagguddua ti dapanna, ket di met agngatingat, carugityonto; tunggal maysa a mangsagid cadacuada narugitto.",
			"27": "<sup>27</sup> Ket anyaman cadagiti an-animal a mangipagna cadagiti ramramay ti sacana nga uppat, narugit cadacayo dagita: siasinoman a tao a mangsagid iti bangcay a natay dagidiay, narugitto agingga iti rumabii.",
			"28": "<sup>28</sup> Ket ti mangawit iti bangcay a natay dagita labaannanto ti pagan-anayna ket dinto nadalus agpapan iti rumabii: dagita carugityo ida.",
			"29": "<sup>29</sup> Ket cadagiti agcarcarayam nga agay-ayam iti daga, dagitoy ti macarugit cadacayo: ti comadreja, ken ti bao, ken ti banias ken cakitana,",
			"30": "<sup>30</sup> Ken ti tecca, ken ti buaya, ken ti aluti-it, ken ti alibut, ken ti berroroco.",
			"31": "<sup>31</sup> Dagitoy isuda ti carugityo cadagiti amin nga aguy-uyas: sianoman a mangsagid cadacuada no natayda, narugitto inggana iti rumabii.",
			"32": "<sup>32</sup> Ket uray ania a nacaitinnagan dagidiay, no natayda, narugitto; uray no latoc a cayo, uray pagan-anay, uray lalat, uray supot, uray ania man nga alicamen a maaramat iti aramiden, rebbengdanto ti maicabil iti danum, ket saandanto a nadalus inggana ti rumabii, daytanto ti pannacadalusna.",
			"33": "<sup>33</sup> Ket tunggal damili a pacaipisocan ti maysa cadagidiay, uray ania nga adda iti unegna, saanto a nadalus, ket iboongyonto.",
			"34": "<sup>34</sup> Amin a taraon idiay a mabalin a canen, a madanuman, nacarugrugitto; ket amin a mabalin nga inumen nga agyan iti casdiay a damili saanto a nadalus.",
			"35": "<sup>35</sup> Ket amin a maiparabawto iti uray ania a paset ti bagida a natay narugitto; no horno wenno pagisaangan, mawarawaranto narugitda, ket carugityonto ida.",
			"36": "<sup>36</sup> Nupay ti maysa nga ubbog wenno bito a pagurnongan iti danum, nadalusto: ngem maisagid iti bagida a natay saanto a nadalus.",
			"37": "<sup>37</sup> Ket no ti sangcabassit iti bagida a natay agdisso iti bin-i a maimula, nadalus.",
			"38": "<sup>38</sup> Ngem no ti danum maicabil iti bin-i, ken no ti bassit iti bagida, a natay agdisso iti daydiay, narugitto cadacayo.",
			"39": "<sup>39</sup> Ket uray no ania nga animal, a mabalinyo a sidaen, matay; ti macasagid iti bagida a natay narugitto agpapan iti rumabii.",
			"40": "<sup>40</sup> Ket ti mangan iti bagi daydiay a natay, labaannanto dagiti pagan-anayna ket narugitto agingga iti rumabii.",
			"41": "<sup>41</sup> Ket tunggal maysa nga animal nga aguyas nga agcarcarayam iti daga maysa a nacarimrimon; daytoy dinto macan.",
			"42": "<sup>42</sup> Uray ania nga yuyusna ti bucsitna, ken uray ania a mangicarayam cadagiti uppat a sacsacana, wenno uray ania nga adu ti sacsacana, uray dagup amin nga agcarcarayam iti daga, dicayto mangan cadagita, ta dagita macarimonda.",
			"43": "<sup>43</sup> Dicayto agaramid iti pacarimonan cadacayo maipuon laeng iti maysa nga animal nga aguy-uyas; dicayto met mangar-aramid iti pacarugitanyo cadagidiay, tapno mamulitancayo gapu cadacuada.",
			"44": "<sup>44</sup> Ta siac ni Jehova a Diosyo: santificarenyo dagiti bagbagiyo, ket agsantocayo; ta siac santoac: dicayto met mulmulitan dagiti bagbagiyo iti uray-ania a kita cadagiti aguy-uyas nga aggaraw iti rabaw ti daga.",
			"45": "<sup>45</sup> Ta siac ni Jehova a nangaon cadacayo iti daga nga Egipto, ta siac ti Diosyo: isu ti gapuna nga agsantocayto, ta siac santoac.",
			"46": "<sup>46</sup> Daytoy ti alagaden maipapan iti animal, ken iti tumatayab, ken iti amin a parsua a nabiag nga aggaraw iti danum, ken iti amin a naparsua nga aguy-uyas iti daga,",
			"47": "<sup>47</sup> Tapno mailasin ti saan a nadalus ken ti nadalus, ken ti nabiag a parsua a mabalin a canen, ken ti naparsua a nabiag a saan a macan."
		},
		"12": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel a cunam, No ti maysa a babai agsicug ket mangyanac iti maysa a lalaki, pitonto nga aldaw a saan a nadalus; cas cadagiti al-aldaw ti kinarugit ti panagsangailina saanto a nadalus.",
			"3": "<sup>3</sup> Ket iti maicawalo nga aldaw macugitto ti ubing iti lasag ti prepuciona.",
			"4": "<sup>4</sup> Ket ti babai urayennanto ti tallopulo ket tallo nga al-aldaw a panagdalusna iti dara; dinanto sagiden ti anyaman a nasantoan, dinto met sumrec iti yan ti santuario inggana ti pannacatungpal ti aldaw a panagdalusna.",
			"5": "<sup>5</sup> Ngem no mangyanac iti babai dua a lawasna a maibilangto a saan a nadalus, cas iti kinarugitna; ket isu urayennanto ti innem a pulo ket innem nga aldaw a panagdalusna iti dara.",
			"6": "<sup>6</sup> Ket no masungpot dagiti al-aldaw a panagdalusna, maipaay iti anacna a lalaki wenno babai, yegnanto iti padi ti maysa a cordero a tumawenen cas daton a mapuuran, ken maysa nga urbon ti calapati, wenno maysa a pagaw a daton gapu iti basol agingga iti ruangan ti tolda ti gimong:",
			"7": "<sup>7</sup> Ket ti padi idatonnanto iti sango ni Jehova, ket aramidennanto ti pannacaabbongna; ket ni naganac madalusanton iti lunayenna. Daytoy ti alagadenna nga aganac iti lalaki man wenno babai.",
			"8": "<sup>8</sup> Ket no awan ti umanay nga igatangna iti maysa a cordero, mangalanto ngarud iti dua a pagaw wenno dua nga urbon ti calapati; ti maysa agservi a daton a mapuuran, ket ti caduana agservi a daton gapu iti basol, ket ti padi aramidennanto a pacaabbonganna, ket nadalusto."
		},
		"13": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao cada Moises ken Aaron, a kinunana,",
			"2": "<sup>2</sup> No iti maysa a tao adda tumaud a letteg, iti cudil ti lasagna wenno latlat, wenno aglaslasilas, ket agbalin a sakit a cucutel iti cudil ti lasagna, maipanto ngarud ken Aaron, a padi, wenno iti maysa cadagiti annacna a lallaki a padi:",
			"3": "<sup>3</sup> Ket ti padi imatangannanto ti sacsakiten iti cudil ti lasag; ket no ti dutdut iti sacsakiten nagpuraw, ket ti langa ti sacsakiten naun-uneg ngem iti cudil ti lasagna, dayta ti sakit a cucutel; ket ti padi amirisennanto, ket ikeddengnanto nga isu saan a nadalus.",
			"4": "<sup>4</sup> Ket no ti yan ti lasilas nagpuraw iti cudil ti lasagna, ket agparang a saan a naun-uneg ngem iti cudil, ket ti dutdut iti dayta saan a nagpuraw, no casta ti padi ipaingnanto ti adda sacsakitenna iti pito nga aldaw;",
			"5": "<sup>5</sup> Ket ti padi kitaennanto ti maicapito nga aldaw: ket, adtoy, ta no, ti pannacaimatangna, ti sacsakiten saan a dimmackel, ket ti sacsakiten saan a nagwaras iti cudil, ti padi ngarud ipaingnanto pay laeng iti pito nga aldaw;",
			"6": "<sup>6</sup> Ket ti padi kitaennanto man met laengen iti maicapito nga aldaw, ket, adtoy, no ti sacsakiten nalitem, ket ti sacsakiten saan a nagwaras iti cudil, ti padi ibatadnanton ngarud nga isu nadalusen: latlat ti adda; ket isu labaannanto dagiti pagan-anayna, ket nadalusto.",
			"7": "<sup>7</sup> Ngem no ti latlat agwaras iti cudil calpasan ti pannacaiparangna iti padi tapno madalusan, iparangnanto a balbaliwan ti bagina iti padi:",
			"8": "<sup>8</sup> Ket ti padi imatangannanto, ket adtoy, no ti latlat nagwarasen iti cudil, ti padi ibatadnanto a casta a saan a nadalus: dayta ti cucutel.",
			"9": "<sup>9</sup> No ti sakit a cucutel adda iti tao, maidatagto ngarud iti padi;",
			"10": "<sup>10</sup> Ket ti padi kitaennanto; ket adtoy, no adda letteg a puraw iti cudil, ket pinagbalinna a puraw ti dutdut, ket adda nabiag a lasag nga awan cudilna iti letteg.",
			"11": "<sup>11</sup> Dayta nabayagen a cucutel iti cudil ti lasagna, ket ti padi ibatadnanto nga isu saan a nadalus: dinanto ipapaing, ta isu saan a nadalus.",
			"12": "<sup>12</sup> Ket no ti cucutel agwaras iti cudil, ket ti cucutel ramanenna amin a cudil ni agcucutel, manipud olona agingga iti sacana, ket ti padi makitanan a casta;",
			"13": "<sup>13</sup> Ti padi ngarud ammirisennanto; ket, adtoy, no ti cucutel nalungpusna amin ti lasagna, ibatadnanto a nadalus ni nagsacsakit: pimmuraw amin; isu nadalusen.",
			"14": "<sup>14</sup> Ngem inton agparang kencuanan ti nabiag a lasagna, saanto laeng a nadalus.",
			"15": "<sup>15</sup> Ket ti padi imatangannanto ti lasagna nga awan cudilna, ket ibatadnanto a saan a nadalus: ti awan cudilna a lasag saan a nadalus: isu dayta ti cucutel.",
			"16": "<sup>16</sup> Wenno, ti awan cudilna a lasag agsubli, ket agsucat iti puraw, no casta dumatagto iti padi:",
			"17": "<sup>17</sup> Ket ti padi imatangannanto: ket, adtoy, no ti sacsakiten nagpuraw, ti padi ngarud ibatadnanto a nadalus ni nagsacsakit: isu nadalus.",
			"18": "<sup>18</sup> Ket no iti cudil ti lasag ti nagtaudan ti letteg, ket immimbagen,",
			"19": "<sup>19</sup> Ket iti nagsaadan ti letteg tumubo ti letteg a napuraw, wenno lasilas, lumabaga a puraw, no casta maiparangto iti padi;",
			"20": "<sup>20</sup> Ket ti padi imatangannanto; ket, adtoy, no ti langana nalenlennec ngem iti cudil, ket ti dutdut iti yanna nagpurawen, ti padi ngarud ibatadnanto a saan a nadalus: dayta ti sakit a cucutel, timmaud iti yan ti letteg.",
			"21": "<sup>21</sup> Ngem no ti padi imatangannanto, ket adtoy, awan dutdut a nagpuraw idiay, ket saan a nalenlennec ngem iti cudil, ngem ket di nalitem; ti padi ngarud ipaingnanto bayat dagiti pito nga aldaw:",
			"22": "<sup>22</sup> Ket no dayta agwaras iti cudil, ti padi ngarud ibatadnanto a saan a nadalus: dayta ti sacsakiten.",
			"23": "<sup>23</sup> Ngem no ti lasilas adda laeng iti tinaudanna, ket saan a nagpacpakilo, dayta ti nagpiglatan ti letteg; ket ti padi ibatadnanto a nadalus.",
			"24": "<sup>24</sup> Wenno no ti lasag iti yan ti cudil a nasinit iti apuy, ket ti nasalunat a lasag ti nasinit aglasilas a lumabaga ken pumuraw, wenno puraw;",
			"25": "<sup>25</sup> No casta ti padi ammirisennanto daydiay; ket, adtoy, no ti dutdut iti yan ti lasilas agpuraw, ket ti nagparanganna nalenlennec ngem ti cudil; dayta ti cucutel, timmaud iti yan ti nasinit: ket ti padi ibatadnanto a saan a nadalus: dayta ti sakit a cucutel.",
			"26": "<sup>26</sup> Ngem no ti padi ammirisennanto daydiay, ket, adtoy, awan puraw a dutdut iti yan ti lasilas, ket saan a nalenlennec ngem ti cudil, ngem nalitem; ti padi ngarud ipaingnanto bayat dagiti pito nga aldaw:",
			"27": "<sup>27</sup> Ket ti padi ammirisennanto iti maicapito nga aldaw: no nagwaras iti cudil, ti padi ngarud ibatadnanto nga saan a nadalus: dayta ti sacsakiten a cucutel.",
			"28": "<sup>28</sup> Ket no ti lasilas adda laeng iti nagsaadanna, ket saan a nagsacnap iti cudil, ngem nalitem; dayta ti letteg ti nasinit, ket ti padi ibatadnanto a nadalus: ta dayta ti pagpiglatan ti nasinit.",
			"29": "<sup>29</sup> Ket no ti maysa a lalaki wenno babai adda sacsakitenna iti olo wenno timid,",
			"30": "<sup>30</sup> Iti casta ti padi imatangannanto ti sacsakiten; ket, adtoy, no ti langana nalenlennec ngem ti cudil, ket adda boocna nga amarillo a nalapat, no casta ti padi ibatadnanto a saan a nadalus: isu dayta ti dogoldogol, dayta ti cucutel ti olo wenno timid.",
			"31": "<sup>31</sup> Ket no ti padi maimatanganna ti sacsakiten a dogoldogol, ket, adtoy, ti langana saan a nalenlennec ngem ti cudil, ket awan ti boocna a nangisit, ti padi ngarud ipaingnanto ni agsacsakit iti dogoldogol iti pito nga aldaw:",
			"32": "<sup>32</sup> Ket iti maicapito nga aldaw ti padi imatangannanto ti sacsakiten; ket, adtoy, no ti dogoldogol saan a nagwaras, ket awan ti amarillo a boocna, ket ti langa ti dogoldogol saan a nalenlennec ngem ti cudil.",
			"33": "<sup>33</sup> Makiskisanto ngarud, ngem saan a kiskisan ti dogoldogol; ket ti padi ipaingnanto pay laeng ni agsacsakit iti dogoldogol cadagiti pito nga aldaw.",
			"34": "<sup>34</sup> Ket iti maicapito nga aldaw ti padi imatangannanto ti dogoldogol, ket adtoy, no ti dogoldogol saan a nagwaras iti cudil, ket ti langana saan a nalenlennec ngem ti cudil; ti sacerdote ibatadnanto ngarud a nadalus: ket labaannanto dagiti pagananayna, ket nadalus.",
			"35": "<sup>35</sup> Ngem no ti dogoldogol nagwaras iti cudil, calpasan ti panagdalusna,",
			"36": "<sup>36</sup> Iti casta ti padi imatangannanto; ket, adtoy, no ti dogoldogol nagwaras iti cudil, ti padi dinanto sapulen ti amarillo a booc; isu saan a nadalus.",
			"37": "<sup>37</sup> Ngem no iti pannacaimatangna saan a nagpacpakilo ti dogoldogol, ket tinuboan ti nangisit a booc; ti dogoldogol immimbagen isu nadalus: ket ti padi ibatadnanto a nadalus.",
			"38": "<sup>38</sup> Ket no lalaki wenno babai ti adda lasilasna iti cudil ti lasagna, uray pay puraw a lasilas;",
			"39": "<sup>39</sup> Iti casta ti padi imatangannanto; ket, adtoy, no dagiti lasilas iti cudil ti lasagda nalitem a puraw, dayta ti curad, nagtaud iti cudil, isu nadalus.",
			"40": "<sup>40</sup> Ket no ti booc ti tao nagparut iti olona, isu ti calbo; nupay casta nadalus.",
			"41": "<sup>41</sup> Ket no ti boocna nagparut iti akinsango a paset ti olona, isu ti ludingas nupay casta nadalus.",
			"42": "<sup>42</sup> Ngem no iti calbo, wenno iti ludingas adda lumabaga a puraw a sacsakiten; dayta ti cucutel a tumaud iti calbo, wenno iti ludingas.",
			"43": "<sup>43</sup> Imatanganto ngarud ti padi, ket, adtoy, no ti letteg ti sacsakiten lumabaga a puraw iti calbona wenno ludingasna, cas iti langa ti cucutel iti cudil ti lasag;",
			"44": "<sup>44</sup> Isu ti tao nga agcucutel, saan a nadalus: ti padi ibatadnanto nga ipatalged nga isu saan a nadalus; ti sacsakitenna adda iti olona.",
			"45": "<sup>45</sup> Ket ti agcucutel nga agsacsakit, dagiti pagan-anayna maray-abdanto, ket ti booc ti olona mawacrayto, ket abbongannanto ti akingato a bibigna, ket agpuccawto, Saan a nadalus, saan a nadalus.",
			"46": "<sup>46</sup> Dagup dagiti aldaw a panagbayag kencuana ti sacsakiten, maibilangto a saan a nadalus; isu saan a nadalus: agwaywayasto iti pagnaedanna; iti ruar ti pacarso ti pagtaengannanto.",
			"47": "<sup>47</sup> Ti met pagan-anay nga adda cucutel, pagan-anay man a de lana wenno pagan-anay a lienzo;",
			"48": "<sup>48</sup> Uray pay iti gan-ay, wenno iti pacan; ti lienzo, wenno ti de lana, uray iti lalat, wenno uray isu-amin a naaramid iti lalat;",
			"49": "<sup>49</sup> No ti sakit bumerde wenno lumabaga iti pagan-anay wenno iti lalat, wenno iti gan-ay wenno ti pacan, wenno iti uray ania nga aruaten a lalat; dayta ti sakit a cucutel, ket rebbengna ti maiparang iti padi:",
			"50": "<sup>50</sup> Ket ti padi imatangannanto ti sakit, ket ipacni daydiay a nagsakit cadagiti pito nga al-aldaw:",
			"51": "<sup>51</sup> Ket iti maicapito nga aldaw imatangannanto ti sakit: no ti sakit nagwaras iti pagan-anay, uray iti gan-ay, wenno iti pacan, wenno iti lalat, nga uray ania a pacaaramatan ti lalat; ti sakit isu ti cucutel a mamagrucop; isu saan a nadalus.",
			"52": "<sup>52</sup> Ket puurannanto ti pagan-anay, uray ti gan-ay wenno pacan, ti de lana wenno lienzo, wenno ti uray ania nga aruaten a lalat, a pagyanan ti sakit: ta dayta isu ti cucutel a mamagrucop; mapuuranto iti apuy.",
			"53": "<sup>53</sup> Ket no ti padi kitaennanto, ket adtoy, ti sakit saan a nagwaras iti pagan-anay, uray iti gan-ay, wenno iti pacan, wenno iti uray ania nga aruaten a lalat;",
			"54": "<sup>54</sup> Ti padi ngarud ibilinnanto a labaandanto ti aruaten nga yan ti saket, ket ipacninanto pay iti pito nga aldaw:",
			"55": "<sup>55</sup> Ket ti padi kitaennanto iti calpasan ti pannacaugas ti sakit; ket, adtoy, no ti sakit saan a nagusaw, ket ti sakit saan a nagwaras, saan a nadalus; ipuurmonto iti apuy: isu ti maysa a panagrucop nupay no ti panagcalbo adda iti ruar man wenno iti uneg.",
			"56": "<sup>56</sup> Ket no ti padi kitaenna, ket, adtoy, ti sakit nagusaw calpasan ti pannacaugasna, iccatennanto ngarud iti aruaten, wenno iti lalat, wenno iti gay-ay wenno iti pacan:",
			"57": "<sup>57</sup> Ket no agparang pay laeng iti aruaten, uray iti gan-ay, wenno iti pacan, wenno iti uray ania nga aruaten a lalat, agwarwaras: puuramto iti apuy dayta a yan ti sakit.",
			"58": "<sup>58</sup> Ket ti pagan-anay, uray ti gan-ay, wenno pacan, wenno ania nga aruaten a lalat nga labaamto, no maiccat ti sakit, ipiduamto a labaan, ket nadaluston.",
			"59": "<sup>59</sup> Daytoy ti alagaden ti sakit a cucutel iti pagan-anay a de lana wenno lienzo, uray iti gan-ay wenno iti pacan, wenno iti uray ania nga aruaten a lalat, tapno pangibatad iti kinadalus, wenno saanna a kinadalus."
		},
		"14": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Daytoy isunto ti alagaden ti agcucutel iti aldaw a pannacadalusna: isu maipanto iti padi:",
			"3": "<sup>3</sup> Ket ti padi mapanto iti ruar ti pacarso; ket ti padi kitaennanto; ket, adtoy, no ti sacsakiten a cucutel imminbag iti nagcucutel ken akincucutel,",
			"4": "<sup>4</sup> Agbilinto ngarud ti padi iti pannacaala iti biang ni padalusan ti dua a sibibiag a tumatayab a nadalus, ken cayo a cedro, ken escarlata, ken hisopo:",
			"5": "<sup>5</sup> Ket ti padi ibilinnanto a mapapatay ti maysa cadagiti tumatayab iti maysa a damili iti yan ti danum nga agay-ayus.",
			"6": "<sup>6</sup> Ti maipapan iti tumatayab a sibibiag, isu alaennanto, ken ti cayo a cedro, ken ti escarlata, ken ti hisopo, ket itanebnanto ida, agraman ti sibibiag a tumatayab, iti dara ti pinatay a tumatayab iti rabaw ti danum nga agay-ayus:",
			"7": "<sup>7</sup> Ket warsiannanto ni padalusan iti cucutel iti maminpito, ket ibatadnanto nga isu nadalus, ket ibbatannanto ti sibibiag a tumatayab iti napanayag a tay-ac.",
			"8": "<sup>8</sup> Ket ni padalusan labaannanto dagiti pagan-anayna, ken kiskisannanto amin a boocna ken dutdutna, ket digosennanto ti bagina iti danum; ket nadalusto: ket iti calpasanna, sumrecto iti pacarso ngem agnaedto iti ruar ti toldana cadagiti pito nga aldaw.",
			"9": "<sup>9</sup> Ket iti maicapito nga aldaw, isu ti panangkiskisnanto iti isu-amin a boocna iti olona, ken ti timidna ken kidayna, uray isu-amin a dutdutna kiskisannanto: ket labaannanto ti pagan-anayna, ket digosennanto ti bagina iti danum, ket nadalusto.",
			"10": "<sup>10</sup> Ket itinto maicawalo nga aldaw mangalanto iti dua a cordero a lallaki nga awan pilawda, ken maysa a cordero a cabayan awan pilawna, nga agtawenen ken tallo a pagcasangapulo nga apag ti maysa nga efa ti namayecmec nga harina a maipaay a daton a macan a nalaocan iti lana, ken maysa a log ti lana.",
			"11": "<sup>11</sup> Ket ti padi a mangdalus kencuana idatagnanto ti tao a padalusan ken dagidiay a banbanag iti sango ni Jehova, iti ruangan ti tolda ti gimong.",
			"12": "<sup>12</sup> Ket ti padi alaennanto ti maysa cadagiti cordero a lalaki, ken ti log ti lana, ket ipaaynanto a daton, gapu iti salungasing, ket ililinanto ida cas daton a maitayag iti sango ni Jehova:",
			"13": "<sup>13</sup> Ket papatayennanto ti cordero a lalaki iti yan a pamatpatayan iti daton gapu iti basol, ken ti daton a mapuuran, iti lugar ti santuario: ta cas ti idaton a gapu iti basol isu ti bagi ti padi, casta met ti daton gapu iti salungasing: isu ti nasantoan unay:",
			"14": "<sup>14</sup> Ket ti padi alaennanto iti dara ti daton gapu iti salungasing, ket ti padi icabilnanto iti pantoc ti lapayag a canawan ni madalusan, ken iti tangan ti imana a canawan, ken iti tangan ti canawan a sacana.",
			"15": "<sup>15</sup> Ket ti padi alaennanto iti log ti lana, ket ibuyatnanto iti daculap ti macatigid nga imana met laeng;",
			"16": "<sup>16</sup> Ket ti padi babasaennanto ti ramayna a canawan iti lana nga adda iti imana a catigid, ket iwarsinanto iti ramayna ti lana iti mamimpito iti sango ni Jehova:",
			"17": "<sup>17</sup> Ket ti matda iti lana nga adda iti imana icabilto ti padi iti pantoc ti lapayag a canawan ni madalusan, ken iti tangan ti imana a canawan, ken iti tangan ti sacana a macanawan, iti rabaw ti dara ti daton gapu iti salungasing:",
			"18": "<sup>18</sup> Ket ti natda iti lana nga adda iti ima ti padi icabilnanto iti olo ni madalusan: ket ti padi aramidennanto a pacaabbonganna, a maipaay ken madalusan iti saclang ni Jehova.",
			"19": "<sup>19</sup> Ket ti padi irucbabnanto ti daton gapu iti basol, ket aramidennanto a pacaabbongan a maipaay ken madalusan gapu iti kinarugitna: ket iti calpasanna papatayennanto ti daton a mapuuran;",
			"20": "<sup>20</sup> Ket ti padi ipaaynanto ti daton a mapuuran ken ti daton a macan iti rabaw ti altar: ket ti padi aramidennanto a pacaabbonganna, ket nadalusto,",
			"21": "<sup>21</sup> Ket no napanglaw, ket awan mabalinna a pangalaan iti casdiay, mangalanto ngarud iti maysa a cordero a lalaki nga agservi a daton a mailili gapu iti salungasing, tapno maaramid a pacaabbonganna, ken maysa a pagcapulo ti maysa nga efa ti namayecmec nga harina a nalaocan iti lana ken maysa a log ti lana daton a macan;",
			"22": "<sup>22</sup> Ken dua a pagpagaw wenno dua nga urbon dagiti calapati, no cas dagita ti mabalinna nga alaen; ket ti maysa isunto ti daton gapu iti basol, ket ti caduana maysa a daton a mapuuran.",
			"23": "<sup>23</sup> Ket iti maicawalo nga aldaw ipannanto ida maipaay ti pagdalusna iti padi, iti ruangan ti tolda ti gimong, iti saclang ni Jehova:",
			"24": "<sup>24</sup> Ket ti padi alaennanto ti cordero a daton gapu iti salungasing, ken ti log ti lana, ket ti padi ililinanto ida a maipaay a daton a maitayag iti sango ni Jehova.",
			"25": "<sup>25</sup> Ket isu papatayennanto ti cordero a daton gapu iti salungasing; ket ti padi mangalanto iti dara ti daton gapu iti salungasing, ket icabilnanto iti pantoc ti lapayag a canawan ni madalusan, ken iti tanganna a canawan, ken tangan ti sacana a canawan.",
			"26": "<sup>26</sup> Ket ti padi mangibuyatto iti lana iti daculapna met laeng ti imana a macatigid;",
			"27": "<sup>27</sup> Ket ti ramay ti macanawan nga ima ti padi iwarsinanto ti dadduma a lana nga adda iti imana a macatigid iti maminpito iti saclang ni Jehova:",
			"28": "<sup>28</sup> Ket ti padi icabilnanto ti lana nga adda iti imana iti pantoc ti lapayag a canawan ni madalusan, ken iti tangan ti imana a canawan, ken iti tangan ti sacana a canawan, iti rabaw ti nacaiccan ti dara ti daton gapu iti salungasing:",
			"29": "<sup>29</sup> Ket ti natda iti lana nga adda iti ima ti padi icabilnanto iti olo ni madalusan, tapno maaramid a pacaabbonganna iti saclang ni Jehova.",
			"30": "<sup>30</sup> Ket isu idatonnanto ti maysa cadagiti pagaw, wenno cadagiti urbon ti calapati, isu nga cas cabaelanna nga alaen;",
			"31": "<sup>31</sup> Uray ania cadagiti cabaelanna nga alaen, ti maysa agservi a daton gapu iti basol, ket ti caduana agservi a daton a mapuuran, agraman ti daton a macan: ket ti padi aramidennanto ti pannacaabbong a maipaay ken madalusan iti saclang ni Jehova.",
			"32": "<sup>32</sup> Daytoy ti alagaden ti agsakit iti cucutel a dinanto cabaelan a gunoden ti maitutop a pacadalusanna.",
			"33": "<sup>33</sup> Ket ni Jehova nakisao ken Moises ken ni Aaron, a kinunana,",
			"34": "<sup>34</sup> No macadanoncayo iti daga a Canaan, nga itdecto cadacayo a tagicuaenyon ket icabilco ti didigra a cucutel iti maysa a balay idiay daga a tagicuaenyo;",
			"35": "<sup>35</sup> Ti akinbalay ngarud umaynanto ibaga iti padi, a cunana, Ipagarupco a cas la adda maysa a didigra iti balayco.",
			"36": "<sup>36</sup> Ket ti padi ibilinnanto a pagpanawanda ti balay, no ti padi dina pay mapan kitaen idiay ti didigra, tapno amin nga adda iti balay di-coma maaramid a saan a nadalus: ket iti calpasanna ti padi sumrecto a cumita iti balay:",
			"37": "<sup>37</sup> Ket isu imatangannanto ti didigra; ket adtoy, no ti didigra adda cadagiti diddiding ti balay a nagaritgaritan iti nauneg, bumerde wenno lumabaga, ket ti langana immuneg iti diding;",
			"38": "<sup>38</sup> Ti padi ngarud rumuarto iti balay nga inggana iti ruanganna, ket ripcannanto ti balay bayat iti pito nga al-aldaw.",
			"39": "<sup>39</sup> Ket ti padi umayto manen iti maicapito nga aldaw, ket imatangannanto; ket adtoy, no ti didigra nagwaras cadagiti diddiding ti balay;",
			"40": "<sup>40</sup> Ti padi ibilinnanto ngarud nga iccatenda dagiti batbato nga yan ti didigra, ket ibellengda ida iti disso a narugit iti ruar ti ciudad:",
			"41": "<sup>41</sup> Ket ituyangnanto a macuscusan ti balay nga aglawlaw iti unegna; ket isuda ibellengdanto dagiti a macuscusda iti ruar ti ciudad iti disso a narugit:",
			"42": "<sup>42</sup> Ket alaendanto dagiti sabali a batbato, ket icabildanto ida iti yan a nagicatanda, ket isu mangalanto iti sabali a masa, ket palitadaennanto ti balay.",
			"43": "<sup>43</sup> Ket no ti didigra ta sumubli manen, ket rumsua iti uneg ti balay, calpasan ti pinangiccatna cadagiti batbato, ken calpasan ti panangcuscusna iti balay, ken calpasan ti pannacapalitadana manen;",
			"44": "<sup>44</sup> Ti padi sumrecto ngarud, ket imatangannanto; ket adtoy, no ti didigra agado iti uneg ti balay, dayta ti cucutel a mamagrucop iti balay; saan a nadalus.",
			"45": "<sup>45</sup> Ket isu rebbaennanto dayta a balay, dagiti batbatona, ken tartaricayona, ken dagup amin a masa ti balay; ket ipannanto ida iti ruar ti Ciudad iti disso a narugit.",
			"46": "<sup>46</sup> Maysa pay, ti sumrec iti dayta a balay iti bayat ti aldaw a pannacarikepna, saanto a nadalus inggana iti rumabii.",
			"47": "<sup>47</sup> Ket ti agidda iti dayta a balay labaannanto ti pagan-anayna; ket ti mangan iti dayta a balay labaannanto dagiti pagan-anayna.",
			"48": "<sup>48</sup> Ket no ti padi sumrecto tapno imatanganna, ket, adtoy, ti didigra saan a nagado iti dayta a balay, calpasan ti pannacapalitadana; no casta ti padi ibatadnanto a ti balay nadalus, ta ti didigra nagimbagen.",
			"49": "<sup>49</sup> Ket isu alaennanto a pangdalus iti balay ti dua a tumatayab, ken cayo a cedro, ken escarlata, ken hisopo:",
			"50": "<sup>50</sup> Ket papatayennanto ti maysa cadagiti tumatayab iti maysa nga alicamen a damili iti rabaw ti danum nga agay-ayus:",
			"51": "<sup>51</sup> Ket alaennanto ti cayo a cedro, ken ti hisopo, ken ti escarlata, ken ti sibibiag a tumatayab, ket ipabatocnanto ida iti danum nga agay-ayus, ket warsiannanto ti balay iti maminpito daras:",
			"52": "<sup>52</sup> Ket dalusannanto ti balay nga aramatenna ti dara ti tumatayab, ken ti agay-ayus a danum, ken ti sibibiag a tumatayab, ken ti cayo a cedro, ken ti hisopo, ken ti escarlata:",
			"53": "<sup>53</sup> Ngem isu ibbatannanto ti sibibiag a tumatayab iti ruar ti ili iti napanayag a tay-ac casta ti panangaramidnanto iti pacaabbongan a maipaay iti dayta a balay; ket nadalusto.",
			"54": "<sup>54</sup> Daytoy ti alagaden a maitutop cadagiti amin a kita ti didigra a cucutel, ken dogoldogol,",
			"55": "<sup>55</sup> Ken maipaay iti cucutel ti maysa a cawes ken ti maysa a balay,",
			"56": "<sup>56</sup> Ken maitutop iti letteg, ken latlat ken lasilas;",
			"57": "<sup>57</sup> A pangisuro no narugit, ken no nadalus: daytoy ti alagaden ti cucutel."
		},
		"15": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises ken ni Aaron, a kinunana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel, ket saoem cadacuada, No adda lalaki nga agtotot ti lasagna, isu narugit gapu iti panagtototna.",
			"3": "<sup>3</sup> Ket daytoyto ti kinarugitna iti panagtototna: uray maicuyog ti lasagna iti panagtototna, wenno di maicuyog ti lasagna iti panagtototna, daytoy ti pagrugitanna.",
			"4": "<sup>4</sup> Amin a nagiddaan ni agtotot narugitto; ken amin a nagtugawanna, narugitto.",
			"5": "<sup>5</sup> Ket siasinoman a macasagid iti iddana, labaannanto dagiti pagpagan-anayna, ket agdigosto iti danum, ket narugit inggana iti rumabii.",
			"6": "<sup>6</sup> Ket ti macatugaw iti uray ania a nagtugawan ni agtotot, labaannanto dagiti pagan-anayna, ket agdigosto iti danum, ket narugitto inggana iti rumabii.",
			"7": "<sup>7</sup> Ket ti macasagid ti lasag ni agtotot labaannanto dagiti cawesna, ket digosennanto ti bagina iti danum, ket narugitto inggana iti rumabii.",
			"8": "<sup>8</sup> Ket no ti addaan iti totot matupraanna ni nadalus, daytoy ngarud labaannanto dagiti cawesna, ket digosennanto ti bagina iti danum, ket narugitto inggana iti rumabii.",
			"9": "<sup>9</sup> Ket uray ania a pagsilla a pagsacayan ni agtottotot narugitto.",
			"10": "<sup>10</sup> Ket siasinoman a macasagid iti nagsaadanna, narugitto agingga iti rumabii: ket ti mangala cadagidiay, labaannanto dagiti pagpagan-anayna, ket agdigosto iti danum, ket saanto a nadalus agingga iti rumabii.",
			"11": "<sup>11</sup> Ket siasinoman a masagid ni addaan totot a dina nabuggoan dagiti imimana iti danum, labaannanto dagiti pagan-anayna, ket agdigosto iti danum, ket narugitto agingga iti rumabii.",
			"12": "<sup>12</sup> Ket ti damili a maiggaman ni agtotot iburacto: ket amin a latoc maboggoanto iti danum.",
			"13": "<sup>13</sup> Ket no ni addaan totot nadalusan iti tototna, bilangennanto dagiti pito nga aldaw manipud panagdaldalusna, ket labaannanto ti pagan-anayna; ket digosennanto ti bagina iti agayayus a danum, ket nadalusto.",
			"14": "<sup>14</sup> Ket iti maicawalo nga aldaw alaennanto a maipaay kencuana ti dua a pagaw wenno dua nga urbon ti calapati, ket umayto iti saclang ni Jehova iti ruangan ti tolda ti gimong, ket itednanto ida iti padi:",
			"15": "<sup>15</sup> Ket ti padi idatonnanto ida, ti maysa maipaay a daton gapu iti basol, ket ti caduana maipaay a daton a mapuuran; ket ti padi aramidennanto ti pannacaabbongna iti saclang ni Jehova a gapu iti panagtototna.",
			"16": "<sup>16</sup> Ket no agwayaway iti siasinoman a lalaki ti tubbog a semilla digosennanto ngarud amin a lasagna iti danum, ket narugitto inggana ti rumabii.",
			"17": "<sup>17</sup> Ket tunggal pagan-anay, ken amin a lalat a naiccan ti tubbog malabaandanto iti danum, ket narugitdanto agingga iti rumabii.",
			"18": "<sup>18</sup> Casta met ti babai a makiabigto ti lalaki, nga agruruar iti semillana, agpadpadadanto a mangdigos cadagiti bagida iti danum, ket narugitdanto agingga iti rumabii.",
			"19": "<sup>19</sup> Ket no iti maysa a babai ta adda agwayaway kencuana, ket ti agwayaway iti lasagna dara, isu saanto a nadalus bayat pito nga al-aldaw: ket siasinoman a sumagid kencuana narugitto agingga iti rumabii.",
			"20": "<sup>20</sup> Ket aniaman a pagiddaanna bayat ti kinarugitna narugitto: casta met nga uray ania a matugawanna narugitto.",
			"21": "<sup>21</sup> Ket siasinoman a macasagid iti iddana labaannanto dagiti pagpagan-anayna, ket digosennanto ti bagina iti danum, ket narugitto agingga iti rumabii.",
			"22": "<sup>22</sup> Ket siasinoman a macasagid iti matugawanna labaannanto dagiti pagan-anayna, ket digosennanto ti bagina iti danum, ket narugitto agingga iti rumabii.",
			"23": "<sup>23</sup> Ket no adda macasagid cadagiti adda iti pagiddaan, wenno uray ania a matugawanna, isu narugitto inggana iti rumabii.",
			"24": "<sup>24</sup> Ket no ti siasinoman a lalaki a makicaidda kencuana, ket maiccan, iti rugitna, dayta narugitto bayat pito nga aldaw; ket aminto a pagiddaanna narugitto.",
			"25": "<sup>25</sup> Ket no ti maysa a babai agbulos ti darana cadagiti adu nga aldaw, a saan a iti tiempo ti panagsangailina, wenno adda kencuana ti panagbulos a nabaybayag ngem iti panagsangailina; amin nga aldaw a panagbulus ti kinarugitna maibilangto nga adda cadagiti aldaw a panagsangailina: isu saan a nadalus.",
			"26": "<sup>26</sup> Amin a pagiddaanna iti dagup ti aldaw ti panagbulosna, maibilangto kencuana a cas la pagiddaanna iti panagsangailina: ket ti amin a matugawanna narugitto a cas ti kinarugit ti panagsangailina.",
			"27": "<sup>27</sup> Ket siasinoman a macasagid cadagidiay narugitto, ket labaannanto dagiti pagan-anayna, ket digosennanto ti bagina iti danum, ket narugitto agingga iti rumabii.",
			"28": "<sup>28</sup> Ngem no immimbagen iti panagbulosna, agbilang ngarud iti pito nga aldaw, ket no nalpas dayta nadaluston.",
			"29": "<sup>29</sup> Ket iti macawalo nga aldaw mangalanto iti dua a pagaw, wenno dua nga urbon ti calapati, ket ipannanto ida iti padi iti ruangan ti tolda ti gimong.",
			"30": "<sup>30</sup> Ket ti padi ipaaynanto ti maysa a daton gapu iti basol, ket ti caduana maipaay a daton a mapuuran: ket ti padi aramidennanto ti pannacaabbongna iti saclang ni Jehova gapu iti panagbulos ti kinarugitna.",
			"31": "<sup>31</sup> Casta ti panangilasinyonto cadagiti annac ti Israel iti kinarugitda, tapno dida matay iti kinarugitda no mulitanda ti tabernaculoc nga adda iti tengngada.",
			"32": "<sup>32</sup> Daytoy ti alagaden ti agtotot ken daydiay nga agwayaway kencuana ti tubbog a semillana, isu a nacarugitanna;",
			"33": "<sup>33</sup> Ken ti agsakit gapu iti panagsangailina, ken ti adda agtotot kencuana lalaki man wenno babai, ken ti makicaidda iti babai a saan a nadalus."
		},
		"16": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, calpasan ti ipapatay dagidi dua nga annac a lallaki ni Aaron, idi immasedegda iti saclang ni Jehova, ket natayda;",
			"2": "<sup>2</sup> Ket ni Jehova kinunana ken Moises, Ibagam ken Aaron a cabsatmo ta saanto a sumsumbrec cadagiti amin nga aldaw iti nasantoan a disso iti uneg ti abbong, a dumanon iti sango ti tugaw ti caasi, nga adda iti rabaw ti lacasa; tapno dimatay: gapu ta siac agparangacto iti ulep iti rabaw ti tugaw ti caasi.",
			"3": "<sup>3</sup> Cadagitoy sumrecto ni Aaron iti tugaw a nasantoan: agraman maysa a lalaki a vaca, nga idaton gapu iti basol, ken maysa a carnero a lalaki a daton a mapuuran.",
			"4": "<sup>4</sup> Isu icawesnanto ti nasantoan a bado a lienzo, ket yarpawnanto met iti lasagna ti sapin a lienzo, ket mabaricsanto iti barikes a liemzo, ket ti mitra a lienzo maicapetto kencuana: dagitoy dagiti nasantoan a pagan-anay, ket isu digosennanto ti bagina iti danum sananto icawes ida.",
			"5": "<sup>5</sup> Ket mangalanto iti gimong dagiti annac ti Israel dagiti dua a calding a lallaki nga idaton gapu iti basol, ken maysa a carnero a lalaki a daton a mapuuran.",
			"6": "<sup>6</sup> Ket ni Aaron idatagnanto ti lalaki a vaca a daton gapu iti basol isu a maipaay kencuana, ket aramidennanto ti pannacaabbongna agraman balayna.",
			"7": "<sup>7</sup> Ket alaennanto dagiti dua a calding, ket idatagnanto ida iti saclang ni Jehova iti ruangan ti tolda ti gimong.",
			"8": "<sup>8</sup> Ket ni Aaron paggasangasatennanto dagiti dua a calding; ti maysa a mapagasatan maipaay ken Jehova, ket ti maicadua ken Azazel.",
			"9": "<sup>9</sup> Ket ni Aaron idatagnanto ti calding a napagasatan a maipaay ken Jehova, ket ipaaynanto kencuana a daton gapu iti basol.",
			"10": "<sup>10</sup> Ngem ti calding, a naipatang ken Azazel, idatagnanto a sibibiag iti saclang ni Jehova, ta aramidennanto a pacaabbonganna, tapno ibaonna a maipaay ken Azazel iti let-ang.",
			"11": "<sup>11</sup> Ket ni Aaron idatagnanto ti lalaki a vaca a daton gapu iti basol, isu a maipaay kencuana, ket aramidenna ti pannacaabbongna agraman balayna, ket patayennanto ti lalaki a vaca a daton gapu iti basol a maipaay kencuana:",
			"12": "<sup>12</sup> Ket isu iggamannanto ti paginciensoan a napno iti beggang ti apuy nga aggapu iti altar iti saclang ni Jehova, ket ti imana a sipupunno iti nasayamusom nga incienso a natumtumec a sagbabassit, ket ipannanto iti uneg ti abbong:",
			"13": "<sup>13</sup> Ket icabilnanto ti incienso iti rabaw ti apuy iti saclang ni Jehova, tapno ti asuc ti incienso macumutanna ti tugaw ti caasi nga adda iti rabaw ti pamanecnec, tapno isu saan a matay:",
			"14": "<sup>14</sup> Ket mangalanto iti dara ti vaca a lalaki, ket iwarsinanto iti ramayna iti rabaw ti tugaw ti caasi iti bangirna iti daya; ket iti sangoanan ti tugaw ti caasi warsiannanto iti ramayna iti dara iti maminpito daras.",
			"15": "<sup>15</sup> Calpasanna patayennanto ti calding a daton gapu iti basol a maipaay iti ili, ket ipannanto ti darana iti uneg ti abbong, ket aramidennanto iti dara ti calding, ti cas inaramidna iti dara ti vaca a lalaki, ket iwarsinanto iti rabaw ken iti sangoanan ti tugaw ti caasi:",
			"16": "<sup>16</sup> Ket aramidennanto ti pannacaabbong ti nasantoan a disso maipuon cadagiti kinarugit dagiti annac ti Israel, ken gapu cadagiti salungasingda, cadagiti amin a basbasolda met laeng: casta met nga aramidennanto ti maipaay iti tolda ti gimong a makipagyan cadacuada iti baet ti kinarugitda.",
			"17": "<sup>17</sup> Ket awanto ti tao iti tolda ti gimong no sumrec nga agaramid iti pannacaabbong iti uneg ti nasantoan a disso, agingga iti di rumuar ken dina maaramid ti pacaabbongan a maipaay kencuana met laeng, ken maipaay iti balayna, ken maipaay iti amin a gimong ti Israel.",
			"18": "<sup>18</sup> Ket isu rumuarto nga agtarus iti ayan ti altar nga adda iti sango ni Jehova, ket aramidennanto ti pannacaabbongda, ket mangalanto iti dara ti lalaki a vaca, ken iti dara ti calding, ket icabilnanto cadagiti sarsara ti altar iti lawlawna.",
			"19": "<sup>19</sup> Ket iwarsinanto ti dara iti ramayna iti rabawna, iti maminpito daras, ket dalusannanto, ket pasantoennanto dagiti rugrugit dagiti annac ti Israel.",
			"20": "<sup>20</sup> Ket no malpasnan a maaramid ti pannacaabbong a maipaay iti nasantoan a disso; ken ti tolda ti gimong, ken ti altar, idatagnanto ti calding a sibibiag:",
			"21": "<sup>21</sup> Ket ni Aaron ipataynanto dagiti dua nga imana iti rabaw ti olo ti sibibiag a calding, ket ipudnonanto iti rabawna ti amin a kinadakes dagiti annac ti Israel, ken amin a salsalungasingda, dagiti amin a basbasolda met laeng; ket icabilnanto ida iti rabaw ti olo ti calding, ket ibaonnanto iti tay-ac babaen iti ima ti maysa a tao a masagsagana.",
			"22": "<sup>22</sup> Ket ti calding ti mangawit a mangipan iti amin a kinadakes iti agpotpotong a daga: ibulosnanto ti calding iti let-ang.",
			"23": "<sup>23</sup> Ket ni Aaron sumrecto iti tolda ti gimong, ket ucsobennanto dagiti cawesna a lienzo a pinagaruatna idi simrec iti nasantoan a disso, ket ibatina ida idiay:",
			"24": "<sup>24</sup> Ket digosennanto ti bagina iti danum iti uneg ti nasantoan a disso, sananto icapet dagiti cawcawesna, sa rumuar, ket ipaaynanto ti datonna a mapuuran, ken ti daton a mapuuran iti biang ti umili, ket aramidennanto ti pannacaabbongna, ken ti maipaay iti biang ti umili.",
			"25": "<sup>25</sup> Ket ti baba ti daton gapu iti basol puurannanto iti rabaw ti altar.",
			"26": "<sup>26</sup> Ket ti mangibulos iti calding a maipaay ken Azazel labaannanto dagiti pagan-anayna, ket digosennanto ti bagina iti danum, ket no malpas, sumrecto iti uneg ti pacarso.",
			"27": "<sup>27</sup> Ket ti lalaki a vaca a daton gapu iti basol, ken ti calding a daton gapu iti basol, a ti darada naidatag a pacaabbongan ti nasantoan a disso, maipandanto iti ruar ti pacarso; ket puurandanto iti apuy dagiti lal-lalatda ken lasagda, ken tackida.",
			"28": "<sup>28</sup> Ket ti mangpuur cadacuada labaannanto dagiti pagan-anayna, ket digosennanto ti bagina iti danum, ket no malpas sumrecto iti uneg ti pacarso.",
			"29": "<sup>29</sup> Ket daytoy ti maalagadto nga agnanayon cadacayo: iti maicapito a bulan, iti maicapulo nga aldaw ti bulan, agladingitto ti cararuayo, ket awanto ti uray ania a trabajo nga aramidenyo, ti umili man wenno gangannaet a makipagtaeng cadacayo:",
			"30": "<sup>30</sup> Gapu ta iti daytoy nga aldaw maaramidto ti pannacaabbongyo, tapno pacadalusanyo; maugasancayto cadagiti amin a basbasolyo iti saclang ni Jehova.",
			"31": "<sup>31</sup> Isu ti aldaw a panaginana ti nadaeg a panaginanayo, ket agladingitto ti cararuayo; daytoy ti maalagad iti agnanayon.",
			"32": "<sup>32</sup> Ket ti padi, a mapulotanto ken maconsagrarto nga agpadi a sono ni amana aramidennanto ti pannacaabbong, ket icapetnanto dagiti cawes a lienzo, dagiti met laeng cawes a nasantoan:",
			"33": "<sup>33</sup> Ket isu aramidennanto ti pannacaabbong a maipaay iti santuario a nasantoan; ket aramidennanto ti pannacaabbong a maipaay iti tolda ti gimong, ken maipaay iti altar; ket aramidennanto ti pannacaabbong a maipaay cadagiti papadi ken maipaay cadagiti amin a tattao ti gimong.",
			"34": "<sup>34</sup> Ket daytoy ti maalagadto cadacayo nga agnanayon, a maaramid a pannacaabbong dagiti annac ti Israel gapu cadagiti amin a basbasolda iti maminsan iti macatawen. Ket inaramidna cas imbilin ni Jehova ken Moises."
		},
		"17": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam ken Aaron ken dagiti annacna a lallaki ken amin nga annac ti Israel, ket cunam cadacuada: Daytoy ti aramid nga ni Jehova imbilinna, a kinunana,",
			"3": "<sup>3</sup> Siasinoman a tao iti balay ti Israel a mangpatay iti maysa a vaca wenno cordero wenno calding iti uneg ti pacarso, wenno ti mangpatay iti ruar ti pacarso.",
			"4": "<sup>4</sup> Ket saanna nga impan iti ruangan ti tolda ti gimong, tapno impaayna coma cas maysa a daton ken Jehova iti sango ti tabernaculo ni Jehova: dara ti maipabiddutto iti dayta nga tao; isu imbellengna ti dara; ket dayta a tao maipusayto iti ilina:",
			"5": "<sup>5</sup> Tapno dagiti annac ti Israel idatagda dagiti datdatonda nga ar-aramidenda iti ruar, tapno idatagda ida met laeng ken Jehova iti ruangan ti tolda ti gimong, iti imatang ti padi, ken irucbabda dagita a maipaay a daton dagiti datdaton iti cappia ken Jehova.",
			"6": "<sup>6</sup> Ket ti padi pagwarisnanto ti dara iti rabaw ti altar ni Jehova iti ruangan ti tolda ti gimong, ket puurannanto ti taba a maipaay a nabanglo a sayamusom ken Jehova.",
			"7": "<sup>7</sup> Ket isuda didanto agaramid cadagiti datdatonda a pagdayaw cadagiti sasairo isuda a sorsorotenda. Daytoy ti pagalagadanto a cancanayon cadacuada iti isu-amin capututanda.",
			"8": "<sup>8</sup> Ket sica ibagamto cadacuada, Siasinoman iti balay ti Israel, wenno cadagiti gangannaet a makipagtaeng cadacuada, a mangirucbab iti daton a mapuuran wenno sacrificio,",
			"9": "<sup>9</sup> Ket saanna a yeg iti ruangan ti tolda ti gimong, tapno idatonna ken Jehova: dayta a tao maipusayto iti ilina.",
			"10": "<sup>10</sup> Ket siasinoman a tao iti balay ti Israel, wenno cadagiti gangannaet a makipagtaeng cadacuada a mangan iti uray ania a dara; iparangconto ti rupac a maibusor iti dayta a tao a mangan iti dara, ket ipusayconto iti ilina.",
			"11": "<sup>11</sup> Ta ti biag ti lasag adda iti dara; ket itedco dayta cadacayo iti rabaw ti altar a maaramid a pacaabbongan a maipaay cadagiti cararuayo; ta dara isu ti macaaramid iti pacaabbongan gapu ta adda kencuana ti biag.",
			"12": "<sup>12</sup> Isu ti gapuna nga imbagac cadagiti annac ti Israel, Awanto cadacayo ti mangan iti dara, uray pay ti siasinoman a gangannaet a makipagtaeng cadacayo dinto mangan iti dara.",
			"13": "<sup>13</sup> Ket siasinoman cadagiti annac ti Israel, wenno cadagiti gangannaet a makipagtaeng cadacuada a manganup iti uray ania nga animal wenno tumatayab a mabalin a canen, ibellengnanto ti darada, sananto gaburan iti tapuc.",
			"14": "<sup>14</sup> Ta ti maipapan iti biag ti amin a lasag, ti darana ken ti biag nagcaycaysada: isu ti gapuna a kinunac cadagiti annac ti Israel, Dicayto mangan iti dara ti uray ania a lasag; ta ti biag ti isu-amin a lasag isu ti darana: siasinoman a mangan kencuana maipusayto.",
			"15": "<sup>15</sup> Ket tumunggal tao a mangan iti natay latta wenno iti pinatay dagiti animal a narungsot, umili man wenno gangannaet, labaannanto dagiti pagan-anayna, ket digosennanto ti bagina, ket saanto a nadalus inggana ti rumabii: calpasanna isu nadalusto.",
			"16": "<sup>16</sup> Ngem no dinanto ida labaan, wenno di agdigos awitennanto ngarud ti kinadakesna."
		},
		"18": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel, ket cunam cadacuada, Siac ni Jehova a Diosyo.",
			"3": "<sup>3</sup> Iti cas cadagiti ar-aramid iti daga sadi Egipto, isu a nagnaedanyo, dicayto ar-aramiden: ket iti cas cadagiti ar-aramid iti daga sadi Canaan, isu a pangipanac cadacayo, dicayto ar-aramiden; dicayto met pagdalanan dagiti al-alagadenda.",
			"4": "<sup>4</sup> Dagiti bilbilinco isuda ti aramidenyonto ket dagiti ipaalagadco salimetmetanyonto tapno isuda ti pagdalananyo; siac ni Jehova a Diosyo.",
			"5": "<sup>5</sup> Iti casta sungpotenyonto dagiti ipaalagadco ken bilbilinco; nga no aramiden ti tao, agbiagto cadacuada; siac ni Jehova.",
			"6": "<sup>6</sup> Awanto cadacayo ti dumenna iti siasinoman nga asideg a cabagianna, tapno lucaisanna ti bagi nga ibainna: siac ni Jehova.",
			"7": "<sup>7</sup> Ti bagi nga ibain ni amam, uray ti bagi nga ibain ni inam, dicanto lucaisan: isu ni inam; dicanto lucaisan ti bagi nga ibainna.",
			"8": "<sup>8</sup> Ti bagi nga ibain ti asawa ni amam dicanto lucaisan: bagi nga ibain ni amam dayta.",
			"9": "<sup>9</sup> Ti bagi nga ibain ni cabsatmo a babai nga anac ni amam, wenno anac a babai ni inam, nayanac man iti balay, wenno nayanac iti sadino man, dicanto met lucaisan ti ibainda a bagi.",
			"10": "<sup>10</sup> Ti bagi nga ibain ti babai nga annac ti anacmo a lalaki, wenno ti babai nga anac ni anacmo a babai, uray ti bagida nga ibain dicanto lucaisan; gapu ta ti ibainda a bagida ibainmo met.",
			"11": "<sup>11</sup> Ti bagi nga ibain ti babai nga anac ni asawa ni amam, isu a pinutot ni amam, isu cabsatmo a babai, dicanto lucaisan ti bagina nga ibainna.",
			"12": "<sup>12</sup> Dicanto lucaisan ti bagi nga ibain ti babai a cabsat ni amam; isu asideg a cabagian ni amam.",
			"13": "<sup>13</sup> Dicanto lucaisan ti bagi nga ibain ti babai a cabsat ni inam: ta isu asideg a cabagian ni inam.",
			"14": "<sup>14</sup> Dicanto lucaisan ti bagi nga ibain ti lalaki a cabsat ni amam, dicanto dumenna ken asawana: isu ikitmo.",
			"15": "<sup>15</sup> Dicanto lucaisan ti bagi nga ibain ti manugangmo a babai: isu asawa ni anacmo a lalaki; dicanto lucaisan ti bagi nga ibainna.",
			"16": "<sup>16</sup> Dicanto lucaisan ti bagi nga ibain ti asawa ni cabsatmo a lalaki: bagi nga ibain ni cabsatmo dayta.",
			"17": "<sup>17</sup> Dicanto lucaisan ti bagi nga ibainna (ti maysa a babai,) ken ti anacna a babai; dicanto alaen ti babai nga anac ni anacna a lalaki, wenno ti babai nga anac ti anacna a babai, tapno lucaisam ti ibainna a bagina; isuda cabagianna ida nga asideg; dayta isu ti kinadakes.",
			"18": "<sup>18</sup> Ket sica dicanto alaen ti cabsat a babai ni asawam a babai, tapno casalisalna, tapno lucaisam ti bagi nga ibainna, a cadua ni asawam iti bayat ti panagbiagna.",
			"19": "<sup>19</sup> Ket sica dicanto adanian ti maysa a babai tapno lucaisam ti bagi nga ibainna, iti bayat ti caaddana a saan a nadalus gapu iti panagsangailina.",
			"20": "<sup>20</sup> Ket sica dicanto caidda a caabig ti asawa ti padam a tao, ta mamulitanca kencuana.",
			"21": "<sup>21</sup> Ket sica dicanto mangted iti uray la no maysa iti putotmo a ipasrecmo ida iti apuy ken Moloch; dicanto met ipabpabareng ti nagan ti Diosmo: siac ni Jehova.",
			"22": "<sup>22</sup> Dicanto caidda ti lalaki a cas ibilang a babai: daytoy ti kinarimon.",
			"23": "<sup>23</sup> Ket sica dicanto caidda ti uray ania nga animal a mulitam ta bagim kencuana; casta met ti siasinoman a babai dinto agyan iti sango ti maysa nga animal tapno makicaidda; gampor daytoy.",
			"24": "<sup>24</sup> Dicay mulmulitan ti bagbagiyo iti uray ania cadagitoy nga aramid: ta amin cadagitoy namulitan dagiti nasnacion nga iyadayoc iti sangoananyo;",
			"25": "<sup>25</sup> Ket ti daga namulitan: isu ti gapuna nga impasarungcarco ti kinadakesna idiay, ket ti daga isaruana dagiti agnaed kencuana.",
			"26": "<sup>26</sup> Isu ti gapuna a dacayo salimetmetanyo dagiti pagalagadac, ken dagiti bilbilinco, ket dicayto ar-aramiden ti uray ania cadagitoy a nacarimrimon; uray no cadaraanyo, uray no gangannaet a makitubo cadacayo;",
			"27": "<sup>27</sup> (Ta amin dagitoy a kinarimon naaramiden idi dagiti tattao nga immun-una ngem dacayo, iti daga, ket ti daga namulitan:)",
			"28": "<sup>28</sup> Tapno ti daga dinacay met isarua, no mamulitanyo, a cas idi panangisaruana iti nacion nga immun-una ngem dacayo.",
			"29": "<sup>29</sup> Ta siasinoman a mangaramidto iti uray ania cadagitoy a kinarimon, dagiti met laeng mangaramid cadagitoy, maipusaydanto iti ilida.",
			"30": "<sup>30</sup> Isu ti gapuna a salimetmetanyonto ti ipaannongco tapno dicay ar-aramaten ti uray ania a nacarimrimon nga awid a naaramid idi awancay pay, ken tapno dicay mulmulitan cadagitoy ti bagbagiyo: siac ni Jehova a Diosyo."
		},
		"19": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam iti dagup ti gimong dagiti annac ti Israel, ket soem cadacuada, Dacayo agsantocayto; gapu ta siac a Jehova a Diosyo, santoac.",
			"3": "<sup>3</sup> Tummunggal maysa a tao cadacayo cabutengnanto ni inana ken amana; ket ngilinenyonto dagiti aldaw a panaginana: siac ni Jehova a Diosyo.",
			"4": "<sup>4</sup> Dicay subsublian dagiti ladladawan, dicay met agar-aramid iti sinucog a didiosen: siac ni Jehova a Diosyo.",
			"5": "<sup>5</sup> Ket no mangidatag cayo cadagiti datdaton iti cappia ken Jehova, idatonyonto tapno maawatcayto.",
			"6": "<sup>6</sup> Macanto met laeng iti aldaw a panangidatonyo, ken iti sumaruno nga aldaw: ket no adda matda iti maicatlo nga aldaw, mapuuranto iti apuy.",
			"7": "<sup>7</sup> Ket no macanto laeng iti maicatlo nga aldaw, maysa a kinarimon; dinto maawat:",
			"8": "<sup>8</sup> Ngem tunggal maysa a mangan, awitennanto ti kinadakesna, ta impabpabarengna ti nasantoan a banag ni Jehova: ket dayta a tao maipusayto iti ilina.",
			"9": "<sup>9</sup> Ket no anienyo ti apit ti dagayo, dicanto anien a talipupusen dagiti nagsulianan ti talonmo, dicanto met adasen dagiti nalabasan iti panagapitmo.",
			"10": "<sup>10</sup> Dicanto adasen ti cauvasam, dicanto met ipenpen ti bunga a natnag ti cauvasam; batiemto ida a lac-amen ti napanglaw, ken ti gangannaet: siac ni Jehova a Diosmo.",
			"11": "<sup>11</sup> Dicayto agtacaw, wenno agaramid a siuulbod, wenno aggiinnulbod.",
			"12": "<sup>12</sup> Ket dicayto agsapata a siuulbod gapu iti naganco, ken ipabpabareng ti nagan ti Diosyo: siac ni Jehova.",
			"13": "<sup>13</sup> Dicanto parparigaten ti padam a tao, wenno tacawen: ti tangdan ti maysa a mangmangged dinto matactac iti biangmo iti agpatpatnag agingga iti bigat.",
			"14": "<sup>14</sup> Dicanto ilunod ti tuleng wenno mangicabil ti pacaitigcolan iti sango ti bulsec; ngem agbutengcanto iti Diosmo: siac ni Jehova.",
			"15": "<sup>15</sup> Dicayto aramiden ti kinakillo iti panangocom: dicanto idumduma ti kinatao ti napanglaw, wenno bigbigen ti kinatao ti mannacabalin; ngem iti naincalintegan ti pangocommo iti padam a tao.",
			"16": "<sup>16</sup> Dicanto agpagnapagna a cas maysa a natarabitab cadagiti cailiam: dicanto met agpangep iti maicaniwas iti dara ti padam a tao: siac ni Jehova.",
			"17": "<sup>17</sup> Dicanto guraen iti napusoan ni cabsatmo: tubngaremto iti napaypayso ti padam a tao ket dicanto mapabasol gapu kencuana.",
			"18": "<sup>18</sup> Dicanto balsen, wenno salimetmetam a maicaniwas ti guram cadagiti annac ti nacionmo; ngem ayatemto ti padam a tao a cas ita bagim: siac ni Jehova.",
			"19": "<sup>19</sup> Tungpalenyonto dagiti bilinco. Dicanto ipamanada ti animalmo cadagiti sabsabali a kita ti animal: dicanto mulaan ti talonmo iti dua a cakita a bini: dinto met maicapet kenca ti aruaten a cawes a dua a cakita nga agtipon.",
			"20": "<sup>20</sup> Ket siasinoman a makiabig iti babai a bag-en a natanianen nga asawa, ket di pay la nasbut, wenno naited ti wayawayana; madusadanto; didanto mapapatay, gapu ta daydiay a babai di pay nawayawayaan.",
			"21": "<sup>21</sup> Ket ti lalaki yegnanto ti daton gapu iti salungasingna ken Jehova iti ruangan ti tolda ti gimong, a maysa met laeng a carnero a lalaki a maipaay a daton gapu iti salungasing.",
			"22": "<sup>22</sup> Ket ti padi aramidennanto a pacaabbonganna ti carnero a lalaki a daton gapu iti salungasing iti saclang ni Jehova, a maipuon iti buddut a nacabasolanna: ket ti biddut a nacabasolanna mapacawanto kencuana.",
			"23": "<sup>23</sup> Ket no macagtengcayon iti daga ken maimulmulayonton ti amin a kita ti caycayo a macan, ibilangyonto dagiti bungbungada a cas awan ti pannacacugitda: tallo a tawen nga addadanto cadacayo a cas saan a nacugit; dagita a bungbunga saanda a macan.",
			"24": "<sup>24</sup> Ngem iti maicapat a tawen amin a bungbungada nasantoandanto a pagdaydayaw ken Jehova.",
			"25": "<sup>25</sup> Ket iti maicalima a tawen canenyonto ti bungana, tapno mangted cadacayo ti kinalabonda: siac ni Jehova a Diosyo.",
			"26": "<sup>26</sup> Dicayto mangan iti uray ania man a sidadara: dicayto met aramaten dagiti panagbuybuyon, wenno agaramid iti padpadles.",
			"27": "<sup>27</sup> Dicayto rabaraban dagiti boocyo, dicanto putputdan ti nagsumbangiran ti barbasyo.",
			"28": "<sup>28</sup> Dicayto sugaten ti lasagyo gapu iti natay wenno mangilanad iti uray ania a pagilasinan iti bagiyo: siac ni Jehova.",
			"29": "<sup>29</sup> Dica tulawan ti anacmo a babai nga aramiden a balangcantis: di la ket ta ti daga matnag iti binabalangcantis, ket ti daga mapnoan iti kinadakes.",
			"30": "<sup>30</sup> Ngilinenyonto dagiti aldawco a panaginana, ket daydayawenyonto ti santuarioc: siac ni Jehova.",
			"31": "<sup>31</sup> Dicay umamang cadagiti managbuyon nga espiritus, wenno cadagiti managsalamangca; dicay makiuman cadacuada ta mamulitancayo cadacuada: siac ni Jehova a Diosyo.",
			"32": "<sup>32</sup> Tumacdercanto iti sango ti ubanan nga olo, ket dayawemto ti langa ti lacay, ket agbutengcanto iti Diosmo: siac ni Jehova.",
			"33": "<sup>33</sup> Ket no makipagtaeng kenca iti dagam ti maysa a gangannaet, dicayto aramiden kencuana ti di tumutop.",
			"34": "<sup>34</sup> Ta gangannaet a makipagtaeng kenca, maibilangto cadacayo a cas cailianyo, ket ayatemto a cas ita bagim; ta dacayo gangannaetcay met idi iti daga nga Egipto, Siac ni Jehova a Diosyo.",
			"35": "<sup>35</sup> Dicayto ar-aramiden ti kinakillo iti panangocom, iti panagrucod, iti panagtimbeng, wenno iti panagsucat.",
			"36": "<sup>36</sup> Ti apag-isu a pagtimbengan, apag-isu a panimbeng, agpag-isu nga efa, apag-isu nga hin ti icutanyonto. Siac ni Jehova a Diosyo a nangaon cadacayo iti daga nga Egipto.",
			"37": "<sup>37</sup> Ket dacayo tungpalenyonto amin nga ipaalagadco, ken amin dagiti bilbilinco, ket aramidenyo ida. Siac ni Jehova."
		},
		"20": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Maysa pay, ibagamto cadagiti annac ti Israel, Siasinoman a lalaki cadagiti annac ti Israel, wenno cadagiti gangannaet a makipagtaeng iti Israel a mangted cadagiti putotna ken Moloch: di bumurong a mapapatayto; dagiti tattao ti daga uburendanto cadagiti batbato.",
			"3": "<sup>3</sup> Iparangconto met ti rupac a sibubusor iti dayta a tao, ket ipusayconto cadagiti cailianna; ta isu nangted iti putotna ken Moloch, a pinangmulitna iti santuarioc, ken pinangipabpabarengna iti nasantoan a naganco.",
			"4": "<sup>4</sup> Ket no dagiti tattao ti daga ilemmengda a talipupusen dagiti matada iti dayta a tao no mangted cadagiti putotna ken Moloch, ket dida papatayen:",
			"5": "<sup>5</sup> Siac ngarud iparangarangconto ti rupac a bumusor iti dayta a tao, ken bumusor cadagiti cacabagianna, ket ipusayconto, agraman amin a sumurot kencuana nga agbalangcantis, tapno makibalangcantis ken Moloch, ipusayconto ida cadagiti cailianda.",
			"6": "<sup>6</sup> Ket ti tao a sumurot cadagiti mangcuculam, ken cadagiti agsalsalamangca nga agbalangcantis cadacuada, pudno nga iparangconto ti rupac a bumusor iti dayta a tao, ket ipusayconto cadagiti cailianna.",
			"7": "<sup>7</sup> Pasantoenyo ngarud dagiti bagbagiyo, ket agsantocayo; ta siac ni Jehova a Diosyo.",
			"8": "<sup>8</sup> Ket sungpotenyonto dagiti ipaalagadco, ket aramidenyonto ida; siac ni Jehova a mamagsanto cadacayo.",
			"9": "<sup>9</sup> Ta amin a lalaki a mangilunod ken amana, wenno ken inana, dinto bumurong a mapapatay: isu inlunodna ni amana, wenno ni inana; ti darana maipaawitto kencuana.",
			"10": "<sup>10</sup> Ket ti lalaki a makicamalala iti asawa ti sabali a lalaki, uray ti makicamalala iti asawa ti carrubana a lalaki, ti lalaki ken ti babai nga agcamalala dinto bumurong a mapapatayda.",
			"11": "<sup>11</sup> Ket ti lalaki a makicaidda iti asawa ni amana linucaisanna ti bagi nga ibain ni amana: isuda a dua dinto bumurong a mapapatayda; ti darada maipaawitto cadacuada.",
			"12": "<sup>12</sup> Ket no ti maysa a lalaki makicaidda iti manugangna a babai, isuda a dua dinto bumurong a mapapatayda: inaramidda ti gampor; ti darada maipaawitto cadacuada.",
			"13": "<sup>13</sup> Ket no ti lalaki makicaidda iti padana a lalaki nga ibilangna a cas babai, isuda a dua nacarimrimon ti aramidda: dinto bumurong a mapapatayda, ti darada maipaawitto cadacuada.",
			"14": "<sup>14</sup> Ket no ti maysa a lalaki mangasawa iti agina, daytoy isu ti kinadakes: isuda mapuurandanto iti apuy, isu ken isuda met: tapno awan kinadakes cadacayo.",
			"15": "<sup>15</sup> Ket no ti maysa a lalaki makicaidda iti maysa nga animal, dinto bumurong a mapapatay: ket dacayo patayenyonto ti animal.",
			"16": "<sup>16</sup> Ket no maysa a babai umasideg iti uray ania nga animal ket caiddana, sica papatayemto ti babai, ken ti animal, dinto bumurong a mapapatayda; ti darada maipaawitto cadacuada.",
			"17": "<sup>17</sup> Ket no ti maysa a lalaki alaenna ni cabsatna a babai, nga anac ni amana, wenno anac ni inana, ket makitana ti bagi nga ibain ni cabsatna, ket daytoy a babai makitana met ti bagi nga ibain ni cabsatna a lalaki; daytoy isu ti aramid a nacababain unay; ket isuda maipusaydanto iti imatang dagiti annac ti ilida: isu linucaisanna ti bagi nga ibain ni cabsatna a babai; isu lacamennanto ti kinadakesna.",
			"18": "<sup>18</sup> Ket no ti maysa a lalaki makicaidda iti maysa a babai nga agsangaili a madama, ket lucaisanna ti bagi nga ibainna; isu linucaisanna ti pagtubboganna, ket ti babai linucaisanna ti pagtubbogan ti darana: ket isuda a dua maipusaydanto cadagiti cailianda.",
			"19": "<sup>19</sup> Ket sica dicanto lucaisan ti bagi nga ibain ni cabsat a babai ni inam, wenno cabswat a babai ni amam; gapu ta linucaisanna ti bagi nga ibain ni cabagianna nga asideg: isuda awitendanto ti kinadakesda.",
			"20": "<sup>20</sup> Ket no ti maysa a lalaki makicaidda iti asawa ni ulitegna, isu linucaisanna ti bagi nga ibain ni ulitegna: isuda awitendanto ti basolda; mataydanto nga awan anacda.",
			"21": "<sup>21</sup> Ket no ti maysa a lalaki alaenna ti asawa ni cabsatna, daytoy nga aramid kinarugit: isu linucaisanna ti bagi nga ibain ni cabsatna: awanto ti anacda.",
			"22": "<sup>22</sup> Iti casta tungpalenyonto amin dagiti ipaalagadco, ken amin dagiti bilbilinco, ket salimetmetanyonto ida; tapno ti daga a pangyegac cadacayo a pagnaedanyo, dinacayto isarua.",
			"23": "<sup>23</sup> Ket dacayo dicayto pagdalanan dagiti awid dagiti tattao a papanawec iti sangoananyo: gapu ta isuda inaramidda amin dagitoy, ket iti casta kinagurac ida.",
			"24": "<sup>24</sup> Ngem kinunac cadacayo, tawidenyonto ti dagada, ket itedconto cadacayo a cucuayo, maysa a daga nga agay-ayus ti gatas ken diro: siac ni Jehova a Diosyo, a nangilasin cadacayo cadagiti tattao.",
			"25": "<sup>25</sup> Iti casta rebbengyo a paggigidiaten ti animal a nadalus ken narugit, ken ti narugit a tumatayab ken nadalus: ket dicayto pagbalinen a nacarimrimon dagiti cararuayo gapu iti animal, wenno gapu iti tumatayab, wenno gapu ti uray ania nga agay-ayam iti daga, isuda nga inlasinco a narugit cadacayo.",
			"26": "<sup>26</sup> Ket dacayo agsantocayto caniac: ta siac a Jehova santoac, ken inlasincayo cadagiti tattao, tapno dacayo ti cucuac.",
			"27": "<sup>27</sup> Casta met ti maysa a lalaki wenno babai a mangcuculam wenno managsalamangca, dinto bumurong a mapapatay: uburendanto ida cadagiti batbato, ti darada maipaawitto cadacuada."
		},
		"21": {
			"1": "<sup>1</sup> Ket ni Jehova kinunana ken Moises, Ibagam cadagiti papadi nga annac a lallaki ni Aaron, ket saoem cadacuada, Awanto ti mangmulit iti bagina met laeng a maipuon iti natay cadagiti cailiana;",
			"2": "<sup>2</sup> Malacsid ti maipanggep iti cabagianna nga asideg, isu nga inana, ken amana, ken anacna a lalaki, ken anacna a babai, ken cabsatna a lalaki,",
			"3": "<sup>3</sup> Ken cabsatna a babai a balasang, nga asideg kencuana, a di pay naasawaan; a gapu kencuana maipalubos nga mulitanna ti bagina.",
			"4": "<sup>4</sup> Isu dinanto mulitan ti bagina a ti bagina met laeng a pagrugitenna, idinto nga isu maysa a natan-oc a lalaki iti ilina, dina tulawan ti bagina.",
			"5": "<sup>5</sup> Didanto pagcalbuen ti oloda wenno kiskisan ti agsumbangir ti timidda, wenno aramiden ti uray ania a sugat iti lasagda.",
			"6": "<sup>6</sup> Agsantodanto iti Diosda, ket dida rugitan ti nagan ti Diosda; ta idatagda dagiti datdaton ken Jehova a naaramid iti apuy, ti tinapay ti Diosda: iti casta agsantodanto.",
			"7": "<sup>7</sup> Isuda didanto makiasawa iti babai a balangcantis, wenno natulawan didanto met alaen ti babai nga insina ti asawana: ta ti padi nasantoan iti Diosna.",
			"8": "<sup>8</sup> Pasantoemto ngarud, ta idatonna ti tinapay ti Diosmo: isu santonto kenca; ta siac ni Jehova a mamagsanto cadacayo, santoac.",
			"9": "<sup>9</sup> Ket ti anac a babai ti uray asino a padi no tulawanna ti bagina iti panagbalangcantis, rugitanna ni amana: isu mapuuranto iti apuy.",
			"10": "<sup>10</sup> Ket ti cangatoan a padi cadagiti cacabsatna a lallaki, nga iti rabaw ti olona nabuyatan iti lana a pangpulot, ken naconsagrar a mangicapet cadagiti cawes, dinanto wacrayen ti boocna, wenno pigisen dagiti cawesna;",
			"11": "<sup>11</sup> Wenno dinto met sumbrec iti uray adino a yan ti bagi a natay, wenno dinanto mulitan ti bagina a maipuon ken amana, wenno ken inana;",
			"12": "<sup>12</sup> Dinto met rumuar iti santuario, wenno tulawan ti santuario ti Diosna; gapu ta ti balangat a lana a pangpulot ti Diosna adda kencuana; siac ni Jehova.",
			"13": "<sup>13</sup> Ket isu mangasawanto iti maysa a balasang.",
			"14": "<sup>14</sup> Balo a babai, wenno nakisina, wenno maysa a natulawan, maysa a balangcantis, dinto mangasasawa cadagitoy; ngem ti maysa a virgen iti ilina met laeng asawaennanto.",
			"15": "<sup>15</sup> Ket dinanto rugitan ti putotna iti baet dagiti cailianna: ta siac ni Jehova a mamagsanto kencuana.",
			"16": "<sup>16</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"17": "<sup>17</sup> Ibagam ken Aaron, a cunam, Uray asino a lalaki cadagiti putotmo cadagiti amin a putputotda nga adda pilawna, saan a maipalubos nga umasideg tapno mangidaton iti tinapay ti Diosna.",
			"18": "<sup>18</sup> Ta uray asino a lalaki nga adda pilawna, dinto umasideg: ti lalaki a bulsec, wenno pilay, wenno lugpac ti agongna, wenno nagsuroc iti uray ania,",
			"19": "<sup>19</sup> Wenno maysa a lalaki a nablo ti sacana, wenno nablo ti imana,",
			"20": "<sup>20</sup> Wenno cubbo, wenno maysa a pandaca, wenno maysa nga mapilaw iti matana, wenno aggudgud, wenno aglatlat, wenno napis-it dagiti bukelbukel;",
			"21": "<sup>21</sup> Iti putot a lalaki ni Aaron a padi, ti adda pilawna dinto umadani a mangipaay cadagiti datdaton a maaramid iti apuy ken Jehova; adda pilawna; dinto umadani a mangidaton iti tinapay ti Diosna.",
			"22": "<sup>22</sup> Manganto iti tinapay ti Diosna, uray tinapay man a nasantoan unay ken ti nasantoan:",
			"23": "<sup>23</sup> Isuna laeng a dinto sumbrec iti uneg ti abbong, wenno umasideg iti altar, gapu ta adda pacapilawanna; tapno dina rugitan dagiti santuarioc: ta siac ni Jehova a mamagsanto cadacuada.",
			"24": "<sup>24</sup> Casta ti pinangibaga ni Moises ken Aaron ken cadagiti annacna a lallaki, ken cadagiti amin nga annac ti Israel."
		},
		"22": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam ken Aaron ken cadagiti annacna a lallaki nga agparbengda cadagiti nasantoan a banbanag cadagiti annac ti Israel, nga ipaayda a santo caniac, ket dida rugitan ti nasantoan a naganco: siac ni Jehova.",
			"3": "<sup>3</sup> Ibagam cadacuada, Siasinoman a lalaki cadagiti amin a putotyo, bayat cadagiti caputotanyo, nga umasideg cadagiti nasantoan a banbanag a pasantoen dagiti annac ti Israel ken Jehova, idinto nga addaan ti rugitna, dayta nga tao maipusayto iti saclangco: siac ni Jehova.",
			"4": "<sup>4</sup> Uray siasino a lalaki nga agcucutel iti putot ni Aaron, wenno agtotot, dinto mangan cadagiti nasantoan inggana ti di nadalus. Ket ti macasagid iti uray ania a narugit gapu iti natay, wenno ti lalaki nga adda agwayaway a tubbog a semilla kencuana;",
			"5": "<sup>5</sup> Wenno siasino a macasagid iti uray ania nga agay-ayam nga isu ti pacarugitanna, wenno maysa a tao a pacarugitanna coma iti uray ania a rugit nga adda kencuana;",
			"6": "<sup>6</sup> Ti tao a macasagid iti uray ania a cacasdiay, narugitto agingga iti rumabii, ket dinto mangan cadagiti nasantoan, malacsid no digosenna ti bagina iti danum.",
			"7": "<sup>7</sup> Ket no limnec ti init, nadalusto; ket iti calpasanna manganto cadagiti nasantoan, gapu ta dayta ti canenna.",
			"8": "<sup>8</sup> Ti natay latta wenno rinangcay ti animal a narungsot, saannanto a canen a pangmulit iti bagina: siac ni Jehova.",
			"9": "<sup>9</sup> Iti casta salimetmetandanto ti ibilinco di la ket ta pacaalaanda iti basol, ken pacatayanda, no dida raeman a cas sagrado: siac ni Jehova a mamagsanto cadacuada.",
			"10": "<sup>10</sup> Awanto ti gangannaet a mangan iti nasantoan a banag: ti maysa a sangaili ti padi, wenno ti maysa a mangmangged dida rebbeng ti mangan iti nasantoan.",
			"11": "<sup>11</sup> Ngem no ti padi gumatang iti maysa a tao, ti nagatang iti piracna, daytoy manganto cadagidiay: ket dagiti nayanac iti balayna, isuda mangandanto iti tinapayna.",
			"12": "<sup>12</sup> Ket no ti anac a babai ti padi makiasawa iti maysa a gangannaet, dayta dinto mangan iti maitayag a daton cadagiti nasantoan.",
			"13": "<sup>13</sup> Ngem no ti anac a babai ti padi balo, wenno nakisina iti asawana, ket awan ti anacna, ket nagsublin iti balay ni amana, cas idi kinaubingna, manganto iti tinapay ni amana: ngem ti gangannaet dinto mangan iti dayta.",
			"14": "<sup>14</sup> Ket no ti maysa a lalaki macapangan a dina ginagara iti nasantoan, inayonnanto ti apagcalima iti daydiay, sananto ited iti padi ti nasantoan a banag.",
			"15": "<sup>15</sup> Ket didanto mulitan dagiti nasantoan a banbanag dagiti annac ti Israel nga idatonda ken Jehova,",
			"16": "<sup>16</sup> Ket   iti casta pacaigapuananda a mangawit iti kinadakes, a pagbiddutan, no canenda dagiti nasantoan a banbanagda: ta siac ni Jehova a mamagsanto cadacuada.",
			"17": "<sup>17</sup> Ket ni Jehova, nakisao ken Moises, a kinunana,",
			"18": "<sup>18</sup> Ibagam ken Aaron, ken cadagiti annacna a lallaki, ken amin nga annac ti Israel, ket saoem cadacuada, Siasinoman a tao iti balay ti Israel, wenno cadagiti gangannaet a makipagtaeng iti Israel a mangidatag iti datonna, nga uray maipuon cadagiti aniaman a carida, wenno aniaman cadagiti datdaton ti sibubulos a nakemda nga ipaayda a daton a mapuuran ken Jehova.",
			"19": "<sup>19</sup> Tapno maannugutancayo, idatonyo ti maysa a lalaki nga animal nga awan pilawna, cadagiti vacvaca, cadagiti carcarnero, wenno cadagiti calcalding.",
			"20": "<sup>20</sup> Ngem uray ania nga adda pacapilawanna, dayta dicayto idaton, gapu ta saanto a maipateg a maipaay cadacayo.",
			"21": "<sup>21</sup> Ket siasino man a mangirucbab iti maysa a sacrificio dagiti daton a cappia ken Jehova a pagtungpalna iti maysa a cari, wenno maipaay a daton ti sibubulos a nakem iti arban, wenno iti pangen masapul nga awan pagcuranganna tapno maawat; daytay awanto ti pacapilawanna.",
			"22": "<sup>22</sup> Bulsec, wenno bullo, wenno pawad, wenno adda dogol-dogolna, wenno aggudgud, wenno aglatlat, dicayto idatag dagitoy ken Jehova, wenno aramiden a maysa a daton iti apuy iti rabaw ti altar ken Jehova.",
			"23": "<sup>23</sup> Uray vaca a lalaki, wenno cordero nga adda suroc wenno curang ti camcamengna, dayta mabalinmo nga ipaay a daton ti sibubulos a nakem; ngem no maipaay a cari, saanto a maawat.",
			"24": "<sup>24</sup> Ti nadunor dagiti, bukelbukelna, wenno napis-it, wenno nataltal, wenno nasugat, dicayto idaton ken Jehova; dicayto met aramiden ti casta iti dagayo.",
			"25": "<sup>25</sup> Uray aggapu iti ima ti gangannaet dicay met idaton ti tinapay ti Diosmo iti uray ania cadagitoy; ta ti kinadakesda adda cadacuada, ti pacapilawan adda cadacuada: saandanto a maawat a maipaay cadacayo.",
			"26": "<sup>26</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"27": "<sup>27</sup> No maysa a lalaki a vaca, wenno carnero wenno calding ti mayanac, pito nga al-aldaw nga addanto iti babaen ti inana; ket manipud iti maicawalo nga aldaw, ken iti sumaruno maawatto a sacrificio ti daton a maaramid iti apuy ken Jehova.",
			"28": "<sup>28</sup> Ket babai man a vaca, wenno carnero dicayto paggiddanen a patayen agraman urbonna iti maymaysa nga aldaw.",
			"29": "<sup>29</sup> Ket no ipaayyo ti maysa a sacrificio a pagyaman ken Jehova, idatonyonto ti pacaannugutanyo.",
			"30": "<sup>30</sup> Iti dayta met la nga aldaw macanto; awanto ti tiddaenyo iti daydiay agingga iti bigat: siac ni Jehova.",
			"31": "<sup>31</sup> Iti casta salimetmetanyonto dagiti bilbilinco, ket tungpalenyonto ida: siac ni Jehova.",
			"32": "<sup>32</sup> Ket dicayto met rugitan ti santo a naganco; ngem siac mapagsantoacto cadagiti annac ti Israel: siac ni Jehova a mamagsanto cadacayo,",
			"33": "<sup>33</sup> A nangaon cadacayo iti daga nga Egipto tapno siac ti Diosyo: siac ni Jehova."
		},
		"23": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel, ket saoem cadacuada, Dagiti natudingan a fifiesta ni Jehova, nga iwarragawagyonto tapno isuda dagiti nasantoan a pacagimongan, dagitoy met laeng ti matudingan a fifiestac,",
			"3": "<sup>3</sup> Cadagiti innem nga al-aldaw agtrabajocayo: ngem ti maicapito nga aldaw isu ti maysa nga inana ti nadaeg a panaginana, ti maysa a nasantoan a pacagimongan; dicayto agtrabajo iti uray ania: isu ti maysa nga aldaw a panaginana ken Jehova iti isu-amin a pagnaedanyo.",
			"4": "<sup>4</sup> Dagitoy dagiti matudingan a fifiesta ni Jehova, a nasantoan a pacagimgimongan, nga iwarragawagyonto iti nadutocan a tiempona.",
			"5": "<sup>5</sup> Iti umuna a bulan iti maicasangapulo ket uppat nga aldaw ti bulan iti rabii, isu ti pascua ni Jehova.",
			"6": "<sup>6</sup> Ket ti maicasangapulo ket lima nga aldaw ti daydiay met la a bulan isu ti fiesta ti tinapay nga awan levadurana ken Jehova: cadagiti pito nga aldaw mangancayto iti saan a nalevaduraan a tinapay.",
			"7": "<sup>7</sup> Iti umuna nga aldaw isu ti panangaramidyonto iti nasantoan a panagiggimong: dicayto agaramid iti trabajo a panggedan.",
			"8": "<sup>8</sup> Ngem mangipaaycayto ken Jehova iti daton a maaramid iti apuy cadagiti pito nga aldaw: iti maicapito nga aldaw: iti maicapito nga aldaw isu ti nasantoan a panaggigimong; dicayto agaramid iti trabajo a panggedan.",
			"9": "<sup>9</sup> Ket ni Jehova nakisao ken Moises, a kinunana.",
			"10": "<sup>10</sup> Ibagam cadagiti annac ti Israel, ket saoem cadacuada, No sumreccayo iti daga nga itedco cadacayo, ket anienyonto ti maapit idiay, mangipancayto ti sangareppet nga umuna a bunga ti maapityo iti padi;",
			"11": "<sup>11</sup> Ket isu ililinanto ti rineppet iti saclang ni Jehova, tapno maawatto a maipaay cadacayo: iti bigat a sumaruno iti aldaw a panaginana, ti padi ililinanto.",
			"12": "<sup>12</sup> Ket iti aldaw a panangililiyo iti rineppet, mangipaaycayto ti maysa a cordero a lalaki nga awan pilawna, a maysa ti tawenna a maipaay a maysa a daton a mapuuran ken Jehova.",
			"13": "<sup>13</sup> Ket ti daton a macan duanto nga apagcapulo ti maysa nga efa a bel-laay a namayecmec nga nagamay iti lana, maysa a daton a maaramid iti apuy a nabanglo a sayamuson ken Jehova; ket ti mainum a daton aracto nga apagcapat ti maysa nga hin.",
			"14": "<sup>14</sup> Ket dicayto cancanen ti tinapay, wenno iniruban a bunga ti trigo, wenno nalangto a dawana, agingga iti castoy met laeng nga aldaw, inggana iti panangidatagyo ti pagdayaw iti Diosyo: daytoy ti maalagad nga agnanayon cadagiti putputotyo cadagiti amin a pagnaedanyo.",
			"15": "<sup>15</sup> Ket bumilangcayto manipud iti bigat a sumaruno iti aldaw a panaginana, manipud ti aldaw a panangidatagyo iti sangcareppet a daton mailili; apagisunto a pito nga aldaw a panaginana:",
			"16": "<sup>16</sup> Agingga met laeng iti bigat a sumaruno iti maicapito nga aldaw ti panaginana, bumilangcayto iti limapulo nga al-aldaw; sacayo mangidatagto ti daton a baro a macan ken Jehova.",
			"17": "<sup>17</sup> Cadagiti balbalayyo mangalacayto cadagiti dua a tinapay nga ilili a casia ti dua nga apagcapulo ti maysa nga efa: dagitay namayecmec a bel-laay malutodanto a silelevadura iti horno, umuna a bungbunga a maipaay ken Jehova.",
			"18": "<sup>18</sup> Ket idatagyonto a mairaman iti tinapay, ti pito a carnero a sag-gaysa ti tawenda nga awan ti pilawda, ken maysa a bumaro a vaca ken dua a carcarnero a lalaki: dagitoy ti daton a mapuuran ken Jehova mainayon pay dagiti datdatonda a macan, ken datdatonda nga mainum, a maysa a daton a maaramid iti apuy, a nabanglo a sayamusom ken Jehova.",
			"19": "<sup>19</sup> Ket mangirucbabcayto iti maysa a calding a lalaki a maipaay a daton gapu iti basol, ken dua a cordero a lallaki a saggaysa ti tawenda, a sacrificio dagiti datdaton iti cappia.",
			"20": "<sup>20</sup> Ket ti padi ililinanto ida agraman ti tinapay cadagiti umuna a bungbunga, a daton a maitayag iti saclang ni Jehova, agraman dagiti dua a cordero: dagitoy nasantoandanto ken Jehova iti padi.",
			"21": "<sup>21</sup> Ket aramidenyonto ti pacdaar iti dayta met laeng nga aldaw; addanto nasantoan a gimong cadacayo; dicayto agaramid ti trabajo a panggedan: isu daytoy ti alagaden nga agnanayon iti amin a balbalayyo cadagiti putputotyo iti casacbayan.",
			"22": "<sup>22</sup> Ket no anienyonto ti apit ti dagayo, dicanto talipupusen nga anien dagiti nagsulianan ti talonmo, wenno adasen dagiti nalabasan iti panagapitmo: baybayamto ida a lac-amen ti napanglaw, ken agpagpagna: siac ni Jehova a Diosyo.",
			"23": "<sup>23</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"24": "<sup>24</sup> Ibagam cadagiti annac ti Israel, a cunam, ti maicapito a bulan, iti umuna nga aldaw ti bulan isu ti nadaeg nga inana cadacayo, maysa a panglagip a buyugen ti aweng dagiti tangtangguyob, maysa a nasantoan a gimong.",
			"25": "<sup>25</sup> Dicayto agaramid iti trabajo a panggedan; ket ipaayyonto ti maysa a daton a maaramid iti apuy ken Jehova.",
			"26": "<sup>26</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"27": "<sup>27</sup> Nupay casta, iti maicasangapulo nga aldaw ti naisao a maicapito a bulan isu ti aldaw ti pannacaabbong: isunto ti maysa a nasantoan a gimong cadacayo, ket agladingitto dagiti cararuayo; ket mangidatagcayto iti maysa a daton a maaramid iti apuy ken Jehova.",
			"28": "<sup>28</sup> Ket dicayto agaramid iti uray ania a trabajo iti dayta met laeng nga aldaw; ta isu ti aldaw ti pannacaabbong, tapno maaramid ti pannacaabbongyo iti saclang ni Jehova a Diosyo.",
			"29": "<sup>29</sup> Ti siasinoman a tao a dinto la agladingit iti cararuana iti daydiay nga aldaw, maipusayto iti ilina,",
			"30": "<sup>30</sup> Ket ti siasinoman a cararua nga agaramid iti uray ania a trabajo iti dayta met la nga aldaw, dayta a tao dadaelecto iti ilina.",
			"31": "<sup>31</sup> Dicayto agaramid iti uray ania nga aramid: isu ti maysa nga alagaden nga agnanayon cadagiti putputotyo iti amin a pagnaedanyo.",
			"32": "<sup>32</sup> Isunto cadacayo ti maysa nga aldaw a panaginana ti nadaeg nga inana, ket agladingitto ti cararuayo: iti maicasiam nga aldaw ti bulan iti sumipnget, manipud iti sumipnget agingga iti sumaruno a sumipnget ngilinenyonto ti aldaw a panaginanayo.",
			"33": "<sup>33</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"34": "<sup>34</sup> Ibagam cadagiti annac ti Israel, ket cunam, Ti maicasangapulo ket lima nga aldaw ti naisao a maicapito a bulan isu ti fiesta dagiti tabernaculo iti bayat dagiti pito nga aldaw a maipaay ken Jehova.",
			"35": "<sup>35</sup> Iti umuna nga aldaw isunto ti nasantoan a gimong; dicayto agaramid a pulos iti trabajo.",
			"36": "<sup>36</sup> Cadagiti pito nga aldaw, mangidatagcayto iti maysa a daton a maaramid iti apuy ken Jehova: iti maicawalo nga aldaw isunto ti nasantoan a gimong cadacayo; ket mangidatagcayto iti maysa a daton a maaramid iti apuy ken Jehova: isu dayta ti nadaeg a gimong: dicay agaramidto iti pacabannogan.",
			"37": "<sup>37</sup> Dagitoy dagiti natudingan a fifiesta ni Jehova, isuda nga ibunannagyo a nasantoan a gimgimong a panangidatagyo iti daton a maaramid iti apuy ken Jehova, daton a mapuuran, ken daton a macan, maysa a sacrificio, ken datdaton nga mainum, tunggal maysa iti aldawna;",
			"38": "<sup>38</sup> Sabali pay dagiti aldaw ni Jehova a panaginana, ken sabali pay dagiti sagsagutyo, ken sabali pay amin a carcariyo, ken sabali pay amin a datdatonyo ti sibubulos a nakem nga ipaayyo ken Jehova.",
			"39": "<sup>39</sup> Nupay casta iti maicasangapulo ket lima nga aldaw ti maicapito a bulan, no maurnongyon dagiti bungbunga ti daga, ngilinenyonto ti fiesta ni Jehova bayat ti pito nga al-aldaw: iti umuna nga aldaw isunto ti nadaeg a panaginana, ket iti maicawalo nga aldaw isunto ti nadaeg a panaginana.",
			"40": "<sup>40</sup> Ket iti umuna nga aldaw, mangalacayto iti maipaay cadagiti bagbagiyo iti bunga dagiti nasayaat a caycayo, sangsanga dagiti palmas, sangsanga dagiti caycayo a narucbos, ken runruno iti ayus; ket agragsaccayto iti sango ni Jehova a Diosyo bayat iti pito nga al-aldaw.",
			"41": "<sup>41</sup> Ket ngilinenyonto a fiesta ken Jehova dagiti pito nga aldaw ti macatawen: isu daytoy ti alagaden iti agnanayon cadagiti putputotyo; iti maicapito a bulan ngilinenyonto.",
			"42": "<sup>42</sup> Agyancayto cadagiti toltolda iti bayat dagiti pito nga aldaw: dagup amin dagiti putot ti Israel agyandanto cadagiti toltolda;",
			"43": "<sup>43</sup> Tapno dagiti putputotyo ammoenda a pinagnaedco dagiti annac ti Israel cadagiti toltolda, idi nga inaonco ida iti daga nga Egipto; siac ni Jehova a Diosyo.",
			"44": "<sup>44</sup> Ket ni Moises inlawlawagna cadagiti annac ti Israel dagiti natudingan a fifiesta ni Jehova."
		},
		"24": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibilinmo cadagiti annac ti Israel a mangyegda kenca ti nadingpil napulpulos a lana ti olivo a pagsilaw, a pagsedden iti pagsaingan tapno sigagangat nga agnanayon.",
			"3": "<sup>3</sup> Iti ruar ti abbong ti pamanecnec, iti uneg ti tolda ti gimong, taripatoento ni Aaron manipud iti malem inggana iti bigat iti saclang ni Jehova iti cancanayon: isunto ti alagaden nga agnanayon cadagiti putputotyo.",
			"4": "<sup>4</sup> Isu taripatoennanto a siuurnos iti patinayon dagiti pagsaingan iti rabaw ti nadalus a candelero iti saclang ni Jehova.",
			"5": "<sup>5</sup> Ket sica mangalacanto iti namayecmec nga harina, ket manglutocanto idiay iti sangapulo ket dua a bibingca: dua nga apagcasangapulo ti maysa a efa, isunto ti maysa a bibingca.",
			"6": "<sup>6</sup> Ket sica urnosemto ida iti dua nga intar, innem iti maysa nga intar iti rabaw ti nadalus a lamisaan iti saclang ni Jehova.",
			"7": "<sup>7</sup> Ket iccamto iti nadalus nga incienso iti rabaw ti tunggal intar, tapno maipaay iti tinapay a panglagip, a maysa met laeng a daton a maaramid iti apuy ken Jehova.",
			"8": "<sup>8</sup> Tunggal aldaw a panaginana urnosennanto iti sango ni Jehova iti agnanayon; isu ti awan patinggana a tulag a maipaay cadagiti annac ti Israel.",
			"9": "<sup>9</sup> Ket maipaayto ken Aaron ken dagiti annacna a lallaki: ket canendanto iti maysa a nasantoan a disso, gapu ta isu ti nasantoan unay kencuana cadagiti datdaton a naaramid iti apuy ken Jehova gapu iti agnanayon nga alagaden.",
			"10": "<sup>10</sup> Ket ti anac a lalaki ti babai nga Israelita, a ti amana maysa nga Egipcio, a napan cadagiti annac ti Israel; ket ti anac ti Israelita a babai ken ti maysa a lalaki nga Israelita nagcabilda a dua iti uneg ti pacarso:",
			"11": "<sup>11</sup> Ket ti lalaki nga anac ti babai nga Israelita nagbassawanganna ti Nagan ni Jehova, ket naglunud; ket impanda ken Moises. Ket ni inana agnagan idi iti Salomit, nga anac ni Dibri iti caputotan ni Dan.",
			"12": "<sup>12</sup> Ket impanda iti pagbaludan tapno malawlawagan cadacuada iti ngiwat ni Jehova.",
			"13": "<sup>13</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"14": "<sup>14</sup> Ipanyo iti ruar ti pacarso dayta nagtabbaaw idi; ket dagiti nacangngeg kencuana ipatayda coma dagiti imimada iti olona, ket amin ti gimong batoenda coma.",
			"15": "<sup>15</sup> Ket sica ibagamto cadagiti annac ti Israel, ket cunam Siasinoman a mangilunud iti Diosna, baclayennanto ti basolna.",
			"16": "<sup>16</sup> Ket ti agtabbaaw iti nagan ni Jehova, dinto bumurong a mapapatay; pudno a dagup ti gimong batoendanto: gangannaet man wenno umili no pagtabbawanna ti nagan ni Jehova, mapapatayto.",
			"17": "<sup>17</sup> Ket ti mangpapatay ti padana a tao, dinto bumurong a mapapatay,",
			"18": "<sup>18</sup> Ket ti mangpapatay ti maysa nga animal rebbengna a sucatan, biag iti biag.",
			"19": "<sup>19</sup> Ket no ti maysa a tao ranggasanna ti padana a tao, cas ti inaramidna, casta met ti maaramidto kencuana:",
			"20": "<sup>20</sup> Ranggas ken ranggas, mata ken mata, ngipen ken ngipen; cas ti ranggas nga aramidennanto iti sabali a tao, casta met ti maaramidto kencuana.",
			"21": "<sup>21</sup> Ket ti mamapatay iti maysa nga animal, supapacannanto: ket ti mamapatay iti maysa a tao, mapapatayto.",
			"22": "<sup>22</sup> Maymaysanto a kita ti linteg ti alagadenyo cas iti maaramid iti gangannaet casta met ti maaramid iti umili: ta siac ni Jehova a Diosyo.",
			"23": "<sup>23</sup> Ket ni Moises imbagana cadagiti annac ti Israel, ket isuda inruarda iti pacarso ti naglunud, sada inubur cadagiti batbato. Ket dagiti annac ti Israel inaramidna ti cas imbilin ni Jehova ken Moises."
		},
		"25": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises idiay bantay Sinai, a kinuana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel, a cunam cadacuada, No macagteng cayo iti daga nga itedco cadacayo, ti daga ngilinennanto ti maysa a panaginana ken Jehova.",
			"3": "<sup>3</sup> Cadagiti innem a tawen mulaamto ti daga, ken cadagiti innem a tawen arbasamto ti cauvasam, ket burasemto dagiti bungbungana;",
			"4": "<sup>4</sup> Ngem iti maicapito a tawen isunto ti maysa a panaginana ti nadaeg nga inana a maipaay iti daga, maysa nga inana ken Jehova: dicanto mulaan ti dagam, wenno arbasan ti cauvasan.",
			"5": "<sup>5</sup> Ti tumubtubo laeng iti nagapitam dicanto anien, ket dagiti uvas ti puon a di naarbasan, dicanto burburasen: isunto ti tawen ti nadaeg a panaginana ti daga.",
			"6": "<sup>6</sup> Ket iti panaginana ti daga agservidanto a taraon cadacayo; kenca, ken ti bag-enmo a lalaki ken babai, ken iti adipenmo a makitegtegged ken iti gangannaet a makipagtaeng kenca.",
			"7": "<sup>7</sup> Ken dagiti amin a bungbungada agservidanto a taraon cadagiti vacvacam, ken cadagiti an-animal nga adda iti dagam.",
			"8": "<sup>8</sup> Ket sica bumilangcanto cadagiti pito a tawen a panaginana, maminpito daras a pito a tawtawen; ket addanto kenca a bilang dagiti pito a tawtawen a panaginana, nga isuda dagiti uppat a pulo ket siam a tawtawen.",
			"9": "<sup>9</sup> Isursuryonto ngarud ti aweng ti tangguyob iti maicasangapulo nga aldaw ti maicapito a bulan; iti aldaw ti pannacaabbong isursuryonto ti tangguyob iti amin a dagayo.",
			"10": "<sup>10</sup> Ket ngilinenyonto ti maicalima pulo a tawen, ket iwarragawagyonto ti wayawaya iti daga cadagiti amin nga agnaed kencuana: isunto ti maysa a jubileo cadacayo, ket masublianyonto tumunggal maysa a tao iti dagana, ket agsublicayto tunggal maysa a tao iti familiana.",
			"11": "<sup>11</sup> Maysanto a jubileo cadacayo, ti maicalimapulo a tawen: dicayto agmula wenno agani cadagiti timmubtubo laeng, wenno burasen dagiti uv-uvas cadagiti puon a dinaarbasan.",
			"12": "<sup>12</sup> Gapu ta isu ti jubileo; isunto ti nasantoan cadacayo: canenyonto ti bungbunga iti dayta a tawen nga aggapu iti taltalon.",
			"13": "<sup>13</sup> Iti daytoy a tawen a jubileo, dacayo isubliyonto tunggal maysa iti cucuana.",
			"14": "<sup>14</sup> Ket no mangilacocayo iti uray ania iti padayo a tao, wenno gumatangcayo iti sanicua ti padayo a tao, dicayto agginnallilaw.",
			"15": "<sup>15</sup> Cas mayannurot iti bilang dagiti tawtawen iti calpasan ti jubileo, gumatangcanto iti padam a tao, ken cas mayannurot iti bilang dagiti tawtawen dagiti ap-apit, isu ti panaglaconanto kenca.",
			"16": "<sup>16</sup> Cas mayannurot iti caadu dagiti tawtawen yadadomto ti nginana, ken cas mayannatup iti cabassit dagiti tawtawen, ibasbassit monto met ti nginana; ta ti bilang dagiti ap-apit ti panglacoanna kenca.",
			"17": "<sup>17</sup> Ket dicayto aggiinnallilaw, no di ket agbutengcayto iti Diosyo: siac ni Jehova a Diosyo.",
			"18": "<sup>18</sup> Isu ti gapuna a tungpalenyonto dagiti bilbilinco, ket salimetmetanyonto dagiti ipaalagadco ken sungputenyo ida; ket agtalinaedcayto a sitatalged iti daga.",
			"19": "<sup>19</sup> Ket ti daga itednanto ti bungana, ket mangancayto nga agpennec, ket agnaedcayto a sitatalged idiay.",
			"20": "<sup>20</sup> Ket no cunayonto, Ania ti canenminto iti maicapito a tawen? adtoy dicamto agmula wenno burasen dagiti apitmi;",
			"21": "<sup>21</sup> No casta ibaonconto ti bendicionco cadacayo iti maicanem a tawen, ket agbunganto iti maipaay cadagiti tallo a tawen.",
			"22": "<sup>22</sup> Ket agmulacayto iti maicawalo a tawen ket mangancayto cadagiti bungbunga a baac a pinenpenpen; inggana iti maicasiam a tawen, agpapan iti panagbungada, mangancayto iti baac a pinenpen.",
			"23": "<sup>23</sup> Ket ti daga saanto a malaco iti awan patinggana, ta ti daga cucuac: ta dacayo gangannaet ken makipagtaengcayo la caniac.",
			"24": "<sup>24</sup> Ket iti amin a daga nga icutanyo ipasubbotyonto.",
			"25": "<sup>25</sup> No ti cabsatmo ta pumanglaw, ket mangilaco cadagiti cucuana, ti cabagianna a caasitgan umaynanto subboten ti inlaco ni cabsatna.",
			"26": "<sup>26</sup> Ket no ti maysa a tao awan kencuana ti mangsubbot, ket bimmacnangen, ket addaanton ti umanay a pagsubbotna;",
			"27": "<sup>27</sup> Ibilangna ngarud dagiti tawen a pannacalacona ket isublina ti matda iti nangilacoanna; ket agsublinto ti panagtagicuaenna.",
			"28": "<sup>28</sup> Ngem no dinanto mabalin a pasublien kencuana, daydiay ngarud inlacona, mabatinto iti ima ni gimmatang agingga iti tawen a jubileo: ket iti dayta a jubileo mayawatto, ket ti naglaco agsublinto iti cucuana.",
			"29": "<sup>29</sup> Ket no ti maysa a tao ilacona ti maysa a balay a pagnaedan, iti maysa a ciudad a nabacudan, mabalinna a subboten iti uneg ti macatawen iti calpasan ti pannacailacona; iti las-ud ti apag-isu a macatawen addanto calinteganna iti panagsubbotna.",
			"30": "<sup>30</sup> Ket no dinto masubbot iti las-ud ti apag-isu a macatawen, ti balay ngarud nga adda iti uneg ti nabacudan a ciudad mapatalgedanto ken gimmatang ti panagtagicuana nga agnanayon agpapan putotna: dinto maisubli iti tawen a jubileo.",
			"31": "<sup>31</sup> Ngem dagiti balbalay dagiti il-ili nga awan bacudda nga aglawlaw maipadadanto cadagiti taltalon iti away: dagitoy masbutdanto, ken maisublidanto iti tawen a jubileo.",
			"32": "<sup>32</sup> Nupay casta dagiti il-ili dagiti Levitas, dagiti balbalay cadagiti il-ili a pagtagicuaanda, mabalin dagiti Levitas a subboten iti uray ania nga aldaw.",
			"33": "<sup>33</sup> Ket no maysa cadagiti Levitas ti summubbot, ti balay ngarud a nalaco, ken ti ciudad a pagtagicuaanna maisublidanto no tawen a jubileo; ta dagiti balbalay cadagiti il-ili dagiti Levitas cucuada ida iti nagtengaan dagiti annac ti Israel.",
			"34": "<sup>34</sup> Ngem ti talon a maidarapat cadagiti il-ilida saan a maipalubos nga ilacoda; ta daytoy ti mataginayon a cucuada.",
			"35": "<sup>35</sup> Ket no ti cabsatmo ta pumanglaw, ket ti imana agpasag kenca; saranayemto ngarud cas maysa a gangannaet, ken maysa a makipagtaeng, makipagbiag kenca.",
			"36": "<sup>36</sup> Dicanto aramaten ti panagpatubo kencuana wenno pamaadu, no di ket agbutengcanto iti Diosmo; tapno ti cabsatmo makipagbiag kenca.",
			"37": "<sup>37</sup> Dicanto ited kencuana ti piracmo iti panagpatubo, wenno ited kencuana dagiti saganam a taraonmo tapno paaduem.",
			"38": "<sup>38</sup> Siac ni Jehova a Diosyo a nangaon cadacayo iti daga nga Egipto itedco cadacayo ti daga a Canaan, ken tapno siac ti Diosyo.",
			"39": "<sup>39</sup> Ket no ti cabsatmo a sitataeng kenca pumanglaw, ket ilacona ti bagina kenca; dicanto pagservien a cas bag-en.",
			"40": "<sup>40</sup> Cas maysa a mangmangged ken cas maysa a makipagtaeng, agnaedto kenca: isu agservinto kenca inggana iti tawen a jubileo:",
			"41": "<sup>41</sup> Isu ti panangpanawnanto kenca, isu ken dagiti annacna nga agcucuyogda ket agsublinto iti familiana, ken agsublinto iti daga dagiti ammana.",
			"42": "<sup>42</sup> Gapu ta adipenco ida nga inaonco iti daga nga Egipto: saandanto a malaco a bag-en.",
			"43": "<sup>43</sup> Dicanto iturayan iti nainget, no di ket agbutengcanto iti Diosmo.",
			"44": "<sup>44</sup> Ket iti maipapan cadagiti bagbag-enmo a lallaki ken babbai nga addanto kenca: cadagiti nasnacion a caparangetmo ti paggatangam iti bagbag-enmo a lallaki ken babbai.",
			"45": "<sup>45</sup> Maysa pay a cadagiti annac dagiti gangannaet a makipagtaeng cadacayo ti pangatanganyonto, ken cadagiti familiasda a makipagyan cadacayo, a pinutotda iti dagayo: ket cucuayonto ida.",
			"46": "<sup>46</sup> Ket pagbalinenyonto ida a maysa a tawid a maipaay cadagiti annacyo a sumaganad cadacayo tapno icutanda ida a sanicua: cadacuada ti pangalaanyonto cadagiti bag-enyo nga agnanayon: ngem cadagiti cacabsatyo nga annac ti Israel dicayto agtitinnuray iti nainget iti maysa ken maysa.",
			"47": "<sup>47</sup> Ket no maysa a gangannaet wenno makipagili kenca bimmacnang, ket ti cabsatmo pimmanglaw iti sibayna, ket ilacona ti bagina iti gangannaet, wenno makipagili kenca, wenno iti capuonan ti familia ti gangannaet;",
			"48": "<sup>48</sup> Calpasan ti pannacailacona mabalin a masbot: maysa cadagiti cacabsatna mabalinna a subboten;",
			"49": "<sup>49</sup> Wenno ti ulitegna, wenno anac ti ulitegna ti mangsubbot kencuana, wenno siasino nga asideg a cabagianna iti caputotanna ti mangsubbot kencuana, wenno no isu bumacnang, subbotenna ti bagina met laeng.",
			"50": "<sup>50</sup> Ket makibinnilangto ken gimmatang kencuana manipud iti tawen a pannacailacona inggana iti tawen a jubileo ket ti pateg ti nacailacoanna maitutopto iti bilang dagiti tawtawen, a maitutop iti bayag ti caaddananto a maysa a bag-en kencuana.",
			"51": "<sup>51</sup> No adu a tawtawen pay, a maitutop iti caaduda, isublinanto ti bayad ti pannacasubbotna iti pirac a nacagatanganna.",
			"52": "<sup>52</sup> Ket no bassit laengen a tawen ti matda agpapan iti tawen a jubileo, makibinnilangto ngarud kencuana: ti maitutop cadagiti tawtawenna a nagservi isublinanto ti bayad ti pannacasubbotna.",
			"53": "<sup>53</sup> Cas maysa a tagabu a mabayadan iti tinawentawen agyanto kencuana: dinanto iturayan iti nainget iti imatangmo.",
			"54": "<sup>54</sup> Ket no dinto macasbot cadagitoy a pamuspusan, lumapsutto ngarud no tawen a jubileo, isu ken dagiti annacna a maicuyog kencuana.",
			"55": "<sup>55</sup> Gapu ta adipenco ida dagiti annac ti Israel; isuda ti adipenco nga inaonco iti daga nga Egipto: siac ni Jehova a Diosyo."
		},
		"26": {
			"1": "<sup>1</sup> Dicayto mangaramid iti didiosenyo, wenno mangbangon iti maysa a ladawan a kinitikitan, wenno maysa a monmon, wenno mangipasdeccayo iti uray ania a umas-asping a bato iti dagayo, tapno daytoy ti pagrucbabanyo: siac ni Jehova a Diosyo.",
			"2": "<sup>2</sup> Ngilinenyonto dagiti aldawco a panaginana, ket pagraemanyonto ti santuarioc: siac ni Jehova.",
			"3": "<sup>3</sup> No magnacayo cadagiti nagbilinac, ket tungpalenyo dagiti bilbilinco, ket salimetmetanyo ida:",
			"4": "<sup>4</sup> Itedconto ngarud dagiti tudo cadagiti carbenganda, ket ti daga pataudennanto ti apit, ket dagiti caycayo iti bangcag agbungadanto.",
			"5": "<sup>5</sup> Ket ti panagbayoyo madanunanto ti panagburas iti uvas, ket ti panagburasyo madanunnanto ti panagipurruac; ket mangancayto nga agpennec iti taraonyo, ket agbiagcayto a sitatalged iti daga.",
			"6": "<sup>6</sup> Ket itedconto ti talna iti daga, ket agiddacayto, ket awanto ti pagbutnganyo; pucawecto dagiti narungsot nga an-animal iti daga, dinto met lumabas ti campilan iti dagayo.",
			"7": "<sup>7</sup> Ket camatenyonto dagiti cabusoryo, ket isuda mapasagdanto iti sangoyo, gapu iti campilan.",
			"8": "<sup>8</sup> Ket ti lima cadacayo pagtarayendanto ti sangagasut, ket ti sangagasut cadacayo pagtarayendanto ti sangapulo ribu; ket dagiti cabusoryo mapasagdanto iti sangoyo gapu iti campilan.",
			"9": "<sup>9</sup> Ket patgencayto, ket parangayencayto, ken paaduencayto, ket ibuangayconto ti tulagco cadacayo.",
			"10": "<sup>10</sup> Ket canenyonto dagiti baac a pinenpen a nabayag a naidulin, ket alaenyonto nga umuna ti baac a gapu iti baro.",
			"11": "<sup>11</sup> Ket icabilconto iti nagtengngaanyo ti tavernaculoc: ket ti espirituc dinacayto carimon.",
			"12": "<sup>12</sup> Ket magnaacto iti nagtengngaanyo, ket siacto ti Diosyo, ket dacayto ti ilic.",
			"13": "<sup>13</sup> Siac ni Jehova a Diosyo a nangaon cadacayo iti daga nga Egipto, tapno dicay mabag-en cadacuada; ket dinadaelco dagiti paco a nacaisangolanyo, ket pinatacdercayo a magna.",
			"14": "<sup>14</sup> Ngem no didacto ipangag, ken dicayto aramiden amin dagitoy a bilbilinco;",
			"15": "<sup>15</sup> Ket no iwacsiyonto dagiti nagbilinac, ket dagiti cararuayo guraenda dagiti bilbilinco, iti casta dicayo aramiden iti amin a bilbilenco, ngem labsingenyo ket di ti tulagco;",
			"16": "<sup>16</sup> Siac aramidecto met daytoy cadacayo: mangicabilacto iti nacakigkigtot cadacayo, nga isu ti sarot ken gorigor a mangdadael cadagiti mata, ken mamagliday iti cararua ket dacayo imulayonto dagiti bin-iyo iti ubbaw, ta dagiti cabusoryo ti manganto.",
			"17": "<sup>17</sup> Ket iparangconto ti rupac a bumusor cadacayo, ket dacayo macabilcayto iti sango dagiti cabusoryo; dagiti gumura cadacayo isudanto ti mangituray cadacayo; ket agtalawcayto nga uray awan ti cumamat cadacayo.",
			"18": "<sup>18</sup> Ket no didacto pay la ipangag gapu cadagitoy, dusaencayto ngarud iti maminpito a daras pay gapu cadagiti basbasolyo.",
			"19": "<sup>19</sup> Ket burakecto ti bileg ti cuspagyo: ket aramidecto ti langityo a cas landoc ken ti dagayo a cas suer;",
			"20": "<sup>20</sup> Ket ti pigsayo maibusto iti ubbaw; gapu ta ti dagayo awanto ti apitna, casta met dagiti caycayo iti daga didanto agbunga.",
			"21": "<sup>21</sup> Ket no magnacayo iti maicaniwas caniac, ket didacto ipangag, yegconto cadacayo iti maminpito a saplit a mayannatup cadagiti basbasolyo.",
			"22": "<sup>22</sup> Ket ibaonconto iti nagtenggaanyo dagiti an-animal a narungsot iti tay-ac a mangtacaw cadacayo cadagiti annacyo, ken mangdadael cadagiti an-animalyo, ken mangpabassitto iti bilangyo; ket dagiti dalanyo agbalindanto a langalang.",
			"23": "<sup>23</sup> Ket no gapu cadagitoy, dicayto la cayat ti mabagbagan caniac no di ket magnacayto laeng iti maibusor caniac;",
			"24": "<sup>24</sup> Iti casta magnanto met ngarud ti maibusor cadacayo, ket cabilencayto met iti maminpito gapu cadagiti basbasolyo.",
			"25": "<sup>25</sup> Ket yegconto cadacayo ti maysa a campilan a mangtungpal ti ibales ti tulag; ket dacayo aggoommungcayto nga agtitipon iti uneg ti iliyo: ket siac ibaonconto cadacayo ti angol; ket dacayo mayawatcayto iti ima ti cabusor.",
			"26": "<sup>26</sup> Intono dadaelec ti ungcay ti tinapayyo, sangapulo a babai dagiti manglutonto iti tinapayyo iti maysa nga horno, ket isublidanto nga ited a tinembeng ti tinapayyo: ket canenyonto, ket dicayto mapnec.",
			"27": "<sup>27</sup> Ket no amin cadagitoy didacto pay la ipangag, ngem busorendacto laeng;",
			"28": "<sup>28</sup> Ti casta siac siuungetacto a bumusor cadacayo ket dusaencayto met ti maminpito gapu cadagiti basbasolyo.",
			"29": "<sup>29</sup> Ket dacayo canenyonto ti lasag dagiti annacyo a lalaki, ken ti lasag dagiti annacyo a babbai canenyonto.",
			"30": "<sup>30</sup> Ket rebbaecto dagiti nangato a disso a pagdaydayawanyo ket duprakekto dagiti didiosenyo a ladladawan ti init, ket ipandagconto dagiti bangcayyo a natay iti ravaw dagiti bagbagi dagiti didiosenyo; ket ti cararuac carimonnacayto.",
			"31": "<sup>31</sup> Ket pagbalinnecto a langalang dagiti il-iliyo, ket pagwalangwalangecto dagiti sansantuarioyo, ket diacto met say-upen ti banglo dagiti sayamusomyo.",
			"32": "<sup>32</sup> Ket paglangalangecto ti daga; ket dagiti cabusoryo nga agnaed kencuana pagsidsiddaawandanto.",
			"33": "<sup>33</sup> Ket iwaraswarascayto cadagiti sabsabali a nacion, ket asutecto ti campilan iti licudanyo: ket iti dagayo awanto ti matagtagitao, ket dagiti iliyo walangwalangdanto.",
			"34": "<sup>34</sup> Iti casta lac-amento ti daga dagiti panaginana iti bayat ti panaglangalangana, ken caaddayo iti daga dagiti cabusoryo; isu met ti panaginananto ti daga ken panaglac-amna cadagiti panaginanana.",
			"35": "<sup>35</sup> Cas iti cabayag ti panaglangalangna casta met ti panaginanananto, nga isu ti inana a dina linac-am cadagiti al-aldawyo a panaginana, idi nagnaedcayo pay kencuana.",
			"36": "<sup>36</sup> Ket cadagiti mabati cadacayo patacrotecto ti pusoda cadagiti daga dagiti cabusorda; ket ti carasacas ti maysa a bulong a maipalais pagtarayennanto ida; ket tumaraydanto a cas iti maysa nga itarayanna ti campilan, ket maipasagdanto nga uray awan cumamat.",
			"37": "<sup>37</sup> Ket isuda maysanmaysa masipparodnanto ti caduana, a cas la adda campilan iti licudan, idinto nga awan agcamat: ket dicayto maitured ti sumango cadagiti cabusoryo.",
			"38": "<sup>38</sup> Ket dacayo matmataycayto iti inilinili, ket ti daga dagiti cabusoryo ibusennacayto.",
			"39": "<sup>39</sup> Ket dagiti matda cadacayo, cumcumbetdanto iti kinadakesda cadagiti dagdaga dagiti cabusoryo; ken casta met a iti kinadakes dagiti nagannac cadacuada cacancanunongdanto ida a cumcumbet.",
			"40": "<sup>40</sup> Ket isuda ipudnodanto dagiti kinadakesda, ken ti kinadakes dagiti ammada, iti salungasingda nga isu ti panangsalungasingda caniac, ken casta met gapu ta nagnada iti maibusor caniac,",
			"41": "<sup>41</sup> Siac met a maibusor cadacuada, ket impanco ida iti daga dagiti cabusorda: no ngarud no agpacumbaba dagiti puspusoda a di nakugit, ket annugotenda ti dusa ti kinadakesda;",
			"42": "<sup>42</sup> Malagipconto ngarud ti tulagco ken Jacob; ken casta met ti tulagco ken Isaac, ken casta met ti tulagco ken Abraham malagipconto; ket malagipconto ti daga.",
			"43": "<sup>43</sup> Ti daga casta met a mabaybay-an gapu cadacuada, ket lac-amenanto dagiti panaginanana iti bayat ti panaglangalangna nga awanda: ket annugotendanto ti dusa ti basolda; ta gapu ta inwacsida dagiti bilbilinco, ket dagiti carcararuada kinaumada dagiti nagbilinac.",
			"44": "<sup>44</sup> Ket nupay casta amin dagita, idinto nga addada iti daga dagiti cabcabusorda diacto iwacsi ida, diacto met cauma ida, tapno rebbekec ida nga italipupos, ken tapno mawara ti tulagco cadacuada; ta siac ni Jehova a Diosda;",
			"45": "<sup>45</sup> Ngem lagipecto a maipaay cadacuada ti tulag dagiti nakin-putot cadacuada nga inaonco iti daga nga Egipto iti imatang dagiti nasnacion, tapno siac coma ti Diosda siac ni Jehova.",
			"46": "<sup>46</sup> Dagitoy dagiti nagbilinan ken bilbilin, ken al-alagaden nga intuyang ni Jehova isu ken cadagiti annac ti Israel idiay bantay Sinai gapu ken Moises."
		},
		"27": {
			"1": "<sup>1</sup> Ket ni Jehova nakisao ken Moises, a kinunana,",
			"2": "<sup>2</sup> Ibagam cadagiti annac ti Israel, ket cunam cadacuada, No ti maysa a tao agcarinto ken Jehova, dagiti tattao maipategdanto ken Jehova a mayannurot iti pananggatadmo.",
			"3": "<sup>3</sup> Ket ti panggatadamto iti lalaki nga manipud agtawen ti duapulo agingga iti innem a pulo, gatadamto ngarud iti limapulo a siclo ti pirac, cas iti siclo ti santuario.",
			"4": "<sup>4</sup> Ket no babai gatadamto iti tallopulo a siclo.",
			"5": "<sup>5</sup> Ket no manipud agtawen ti lima inggana iti duapulo, ti panggatadamto ngarud iti lalaki duapulo a siclo, ket no babai sangapulo a siclo.",
			"6": "<sup>6</sup> Ket no manipud agtawen ti macabulan agingga iti lima a tawen, ti panggatadamto ngarud iti lalaki lima a siclo a pirac, ket no babai gatadamto iti tallo a siclo a pirac.",
			"7": "<sup>7</sup> Ket no manipud agtawen ti innem a pulo ken nasuroc; no lalaki gatadamto ngarud iti sangapulo ket lima a siclo, ket iti babai sangapulo a siclo.",
			"8": "<sup>8</sup> Ngem no napangpanglao ngem ti panggatadam, maipanto iti saclang ti padi ket ti padi gatadannanto; ti mayannatop iti cabaelan ti nagcari isu ti panggatadanto ti padi.",
			"9": "<sup>9</sup> Ket no maysa nga animal, nga idaton dagiti tattao a pagdayaw ken Jehova, dagup amin cadagidiay nga ited ti siasinoman a tao ken Jehova nasantoandanto.",
			"10": "<sup>10</sup> Dinanto baliwan wenno sucatan ti nasayaat iti dakes, wenno ti dakes iti nasayaat: ket no masucatanto laeng iti animal ken animal, isudanto ngarud a dua napagsinnucat agpadpadada a nasantoan.",
			"11": "<sup>11</sup> Ket no maysa nga animal a saan a nadalus, nga dagitoy saan nga mabalin nga idaton ken Jehova, ipannanto ngarud ti animal iti padi.",
			"12": "<sup>12</sup> Ket ti padi gatadannanto, no naimbag wenno dakes: cas iti pananggatad ti padi, castanto.",
			"13": "<sup>13</sup> Ket no cayatnanto a subboten, inayonnanto ngarud ti apagcalima daydiay nanggatadam.",
			"14": "<sup>14</sup> Ket no maysa a tao santificarennanto ti balayna tapno nasantoan ken Jehova, ti padi ngarud gatadannanto, no naimbag wenno dakes: cas iti ikeddengto ti padi, dayta ti matungpalto:",
			"15": "<sup>15</sup> Ket no daydiay nangsantificar iti balayna, subbotennanto, no casta nayonannanto iti apagcalima ti pirac a pinanggatadmo, ket cucuananto.",
			"16": "<sup>16</sup> Ket no ti maysa a tao santificarennanto ken Jehova ti dadduma iti talon a cucuana, iti pananggatadmonto maitutop iti maimulmula; ti mamulaan iti maysa nga omer a cebada, magatadanto iti limapulo a siclo a pirac.",
			"17": "<sup>17</sup> Ket no santificarenna ti talonna manipud iti tawen a jubileo, cas iti panggatadam isu ti matungpalto.",
			"18": "<sup>18</sup> Ngem no santificarennanto ti talonna calpasan ti jubileo, ti padi ngarud ipasangnanto kencuana ti pirac a maitutop cadagiti tawtawen agpapan iti tawen a jubileo; ket maaramidto ti maysa panangkessay iti pananggatadmo.",
			"19": "<sup>19</sup> Ket no ti nangsantificar iti talonna cayatnanto a subboten, inayonnanto ngarud ti apagcalima ti pirac a nanggatadam iti daydiay, ket mapatalgedanto kencuana.",
			"20": "<sup>20</sup> Ket no dinanto subboten ti talon, wenno nalacona ti talon iti sabali a tao, saanto a masubbotten:",
			"21": "<sup>21</sup> Ngem ti talon no mayawat iti tawen a jubileo, nasantoanto ken Jehova, cas maysa a talon a naisagut; maipatagicuanto iti padi.",
			"22": "<sup>22</sup> Ket no santificarenna ken Jehova ti maysa a talon a ginatangna a saan a nayon ti cucuana a sigud:",
			"23": "<sup>23</sup> Ti padi ipasangnanto kencuana ti ngina a nanggatadam agpapan iti tawen a jubileo: ket itednanto ti nanggatadam iti daydiay nga aldaw, cas nasantoan a banag ken Jehova.",
			"24": "<sup>24</sup> Iti tawen a jubileo, ti talon maisublinto ken nacagatanganna, daydiay met laeng nakincucua iti daga.",
			"25": "<sup>25</sup> Ket amin ti pinanggatadmo mayannurotto iti siclo ti santuario: duapulo a gera isunto ti siclo.",
			"26": "<sup>26</sup> Iti laeng umuna nga anac cadagiti an-animal nga agpaay nga umuna a bunga ken Jehova, awanto ti mangsantificar cadacuada, uray no vaca, wenno carnero, cucuan ni Jehova.",
			"27": "<sup>27</sup> Ket no saan a nadalus nga animal, subbotennanto ngarud, cas pananggatadmo, ket inayonnanto iti daydiay ti apagcalimana; ket no dina nasubbot malaconto ngarud cas iti panggatadam.",
			"28": "<sup>28</sup> Ngem saanto a malaco wenno masubbot ti banag a naicari nga icarinto ti maysa a tao ken Jehova iti dagup ti adda kencuana, tao man wenno animal, wenno talon a cucuana: tunggal naicari isu ti nasantoan unay ken Jehova.",
			"29": "<sup>29</sup> Saanto a masubbot ti uray ania a naicari, nga aggapu cadagiti tattao; maipatayto a di agcurang kencuana ni patay.",
			"30": "<sup>30</sup> Ket amin nga apagcapullo ti daga, uray dagiti bucbukel iti daga uray iti bunga ti cayo, cucua ni Jehova: nasantoan ken Jehova.",
			"31": "<sup>31</sup> Ket no ti maysa a tao subbotennanto ti uray aniaman nga apagcapulona, nayonannanto iti apagcalimana.",
			"32": "<sup>32</sup> Ket amin nga apagcapullo ti arban dagiti vacvaca ken ti pangen dagiti carcarnero, uray ania a magna babaen ti sarucod, ti apagcapullo nasantoandanto ken Jehova.",
			"33": "<sup>33</sup> Dinanto amisiren uray naimbag, uray dakes, dinanto met sandian; ket no sandianna laeng, daydiay ken ti maisucat agpadpadadanto a nasantoan: saanto a masubbot.",
			"34": "<sup>34</sup> Dagitoy dagiti al-alagaden nga ni Jehova imbilinna ken Moises a maipaay cadagiti annac ti Israel idiay bantay Sinai."
		}
	}
};
module.exports = book;